9	2018-08-08	We wanted to create a new outlet of fun for kids and adults.	[{"type": "paragraph_block", "id": "c2ecc7ac-790e-48e5-a842-b92ed630d7b7", "value": "<p><b>Motus</b></p><p>Noun</p><p>Origin: Latin</p><p>Definition: movement</p>"}, {"type": "image_block", "id": "32567427-eabe-472d-9635-3bad13b6210c", "value": {"caption": "", "image": 21, "attribution": ""}}, {"type": "paragraph_block", "id": "eb82f1ae-ed90-45e4-9120-7cd3cbc72613", "value": "<p>It took us a lot of time and effort to build this place.. hopefully you will like it as much as we do!</p><p>You might have been around before the transformation of the gym to welcome Motus Ninja Warrior, but if not you can watch this video with the building of Motus Ninja Warrior.</p>"}, {"type": "embed_block", "id": "038a8001-a508-4b01-b382-40cda04eebad", "value": "https://youtu.be/6WdGP6tbG1c"}]	17
29	2019-01-08	Kick off your heels and have some fun at Motus Ladies Night!	[{"type": "paragraph_block", "id": "db72b97f-7212-4810-a0b9-68d2677af3f6", "value": "<p><b>!!HEY LADIES!!</b></p><p>Grab a group of friends and come join the 4 time American Ninja Warrior, Annie Dudek, and Motus&#x27; Director of Operations, Trisha Bealmear, for a fun filled night you will be sure to remember! Enjoy acting like a kid again while playing at KC&#x27;s largest ninja gym.</p><p>Leave your fear at the door and come explore what Motus has to offer!</p><p>No judgement! FUN ENVIRONMENT! All abilities welcome!</p><p>*January 26th from 7:00pm-8:30pm*</p><p>*Ages 18 and over *</p><p>*Only $15 per person*</p>"}]	37
27	2018-10-08	Movement is the foundation to an active lifestyle.	[{"type": "paragraph_block", "id": "ef5552ed-05d8-4ec0-92ad-8988d90b19b2", "value": "<p>Functional fitness exercises are designed to train and develop your muscles to make it easier and safer to perform everyday activities, such as carrying groceries or playing a game of basketball with your kids.</p><p>LIVE MORE!</p><p>Details</p><ul><li>8-week challenge for adults</li><li>Begins October 29th \\u2026 Ends December 22nd</li><li>Must commit to 2 days a week<ul><li>Drop-in rate for extra days = $10</li></ul></li><li>Cost $159: includes 2 complimentary test days (1st week &amp; last week)</li><li>We encourage you to have Monday or Thursday as one of your workout days. Jose&#x27; is the trainer for these night classes and is well seasoned in many varieties of fitness.</li></ul><p>Grand Prize</p><p>1 Free month of unlimited Motus Fit sessions and a Motus shirt</p>"}]	35
15	2018-08-14	Ninjas persevere through any kind of obstacle.	[{"type": "paragraph_block", "id": "4d984526-79c8-4b9e-b941-28b7fca605ce", "value": "<p>This is Eric&#x27;s journey from Stage 4 cancer diagnosis to American Ninja Warrior, to being a plant based spokesperson for THE FOOD CURE.</p>"}, {"type": "embed_block", "id": "f01eee5e-c062-47f4-b765-f09b3107d268", "value": "https://www.youtube.com/watch?v=G-r9pII38M0&feature=youtu.be"}]	20
20	2018-09-15	DO YOU HAVE WHAT IT TAKES TO CONQUER MOTUS?	[{"type": "paragraph_block", "id": "6548ede5-5c3f-48e4-80ce-24ebe3f4abe4", "value": "<p><b>Date:</b> April 27th &amp; 28th</p><p><b>Kids:</b> 04/27/19</p><p><b>Adults:</b> 04/28/19</p><p><b>Competition System:</b> Point</p><p><b>Max Competitors:</b> 30 (For each age group)</p><p><b>Entry Fee:</b> Kids / Teens $50 Adults: $60</p><p><b>Sign-up Deadline:</b> 4/14/19</p><p><b>Adult Prizes: 1st</b> - $150 and medal<b> 2nd</b> - $100 and medal <b>3rd</b> - $60 and medal</p><p><b>Kid Prizes:</b> <b>1st</b> - Medal and open gym pass <b>2nd</b> - Medal <b>3rd</b> - Medal</p><p></p><p><b>KIDS</b></p><p>All competitors will run Stage 1 and Stage 2.</p><p>A combination of Points and Time will determine 1st, 2nd and 3rd place.</p><p><b>Stage 1 Group times</b></p><p>6-7 years check-in time/warm-up: 9AM-9:15AM</p><p>6-7 years course rules: 9:15AM-9:20AM</p><p>6-7 years run start: 9:20AM</p><p>8-10 years check-in time/warm-up: 12:00PM-12:15PM</p><p>8-10 years course rules: 12:15PM-12:20PM</p><p>8-10 years runs start: 12:20PM</p><p>11-13 years check-in time/warm-up: 3:00PM-3:15PM</p><p>11-13 years course rules: 3:15PM-3:20PM</p><p>11-13 years runs start: 3:20PM</p><p>14-17 years check-in time/warm-up: 6:00PM-6:15PM</p><p>14-17 years course rules: 6:15PM-6:20PM</p><p>14-17 years runs start: 6:20PM</p><p><b>Stage 2 Group times</b></p><p>6-7 years Course rules individually as Stage 1 is completed</p><p>6-7 years Runs start after rules</p><p>6-7 years Award 11:30PM</p><p>8-10 years Course rules individually as Stage 1 is completed</p><p>8-10 years Runs start after rules</p><p>8-10 years Award 2:30PM</p><p>11-13 years Course rules individually as Stage 1 is completed</p><p>11-13 years Runs start after rules</p><p>11-13 years Award 5:30PM</p><p>14-17 years Course rules individually as Stage 1 is completed</p><p>14-17 years Runs start after rules</p><p>14-17 years Award 8:30PM</p><p></p><p><b>ADULTS</b></p><p>All competitors will run Stage 1 and Stage 2.</p><p>A combination of Points and Time will determine 1st, 2nd and 3rd place.</p><p><b>Stage 1 times</b></p><p>Adults check-in time/warm-up: 2PM-2:15PM</p><p>Adults course rules: 2:20PM</p><p>Adults run start: 2:30PM</p><p><b>Stage 2 times</b></p><p>Course rules individually as Stage 1 is completed</p><p>Runs start after rules</p><p>Awards 5:00PM</p><p></p><p><b>Stage 1</b></p><p>Points Per Obstacle Completed: 1</p><p>Competitors will receive 1 Point for each obstacle they complete.</p><p>Completing the same obstacle twice will NOT result in more points.</p><p>If an obstacle is failed and there is time remaining on the clock, the competitor may attempt the obstacles again, from the beginning, as many times as needed to obtain a point.</p><p>If a competitor is in the middle of an obstacle and times expires, that obstacle will be considered failed.</p><p>Points will carry-over to Stage 2.</p><p><b>Stage 2</b></p><p>Points Per Obstacle Completed: 1</p><p>Competitors will receive 1 Point for each obstacle they complete.</p><p>Competitors will NOT receive multiple attempts on any obstacle.</p><p>Once an obstacle is failed, they must move on to the next obstacle.</p><p>Competitors may take a 15 second break/rest after completing or failing an obstacle.</p><p></p><p>Email or visit our website to reserve your spot today!</p><p>info@motusninjawarrior.com</p><p><a href=\\"https://app.iclasspro.com/parentportal/motus\\">https://app.iclasspro.com/parentportal/motus</a></p>"}]	31
