14	Unleash your inner warrior!	The Motus Ninja Warrior Camp provides your child with entertaining and challenging activities to keep young minds and bodies sharp.	[{"type": "paragraph_block", "id": "3fa2fc40-ad5d-4c35-b6f2-0d1e6b566671", "value": "<p>Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Sports Camps are for you! At Motus we offer weekly summer camps for ages 5-12. Participants will be led by our knowledgable staff on obstacles, exercises and lots of fun. Thursday afternoon, participants will compete in a Speed Course Competition. Every ninja will be awarded a camp completion certificate on the last day of camp.<br/> Our camps run Monday through Thursday with an open gym pass for Friday. To enroll your student in our Ninja Warrior Camp, call (816) 347-8008 today!</p><p><b>Camp Weeks:</b><br/>June 3rd, 10th, 17th, 24th<br/>July 8th, 15th, 22nd, 29th<br/>August 5th</p><p><b>Camp Cost:</b></p><p>$75 for non-members</p><p>$70 for current members</p><p></p>"}]	16	[{"type": "schedule", "id": "a42f8d43-be81-4e3e-b3a6-404ebb98c01c", "value": {"category": "Motus Camp", "day": "THURSDAY", "times": "10:00-12:00"}}, {"type": "schedule", "id": "b7fe0778-23fb-4610-9b2d-5d3977bece1e", "value": {"category": "Motus Camp", "day": "WEDNESDAY", "times": "10:00-12:00"}}, {"type": "schedule", "id": "a8599d41-52bb-4e8f-ae6f-36f705ffa953", "value": {"category": "Motus Camp", "day": "TUESDAY", "times": "10:00-12:00"}}, {"type": "schedule", "id": "d4a9afa2-120b-4d0e-b9c4-9c2e79e69fdb", "value": {"category": "Motus Camp", "day": "MONDAY", "times": "10:00-12:00"}}]
7	For Kids & Adults	Motus offers the most fun in Lee’s Summit with open gyms, parties, field trips, and team building experiences.	[{"type": "paragraph_block", "id": "255fe4c9-87bf-4a19-a3b9-025b20284139", "value": "<p>Motus offers the most fun in Lee\\u2019s Summit with open gyms, parties, field trips, and team building experiences. Unlock your inner warrior on 240&#x27; of obstacle course, one of our 4 warped walls, the campus board, jumping spider, cliffhanger, or maybe even the wing nuts!</p><p></p><p><b>Daily Open Gym</b></p><p>Open gyms are perfect for burning off energy, testing your strength, conquering challenging obstacles, and having fun! You have access to our entire facility and can work at your own pace. This is not an instructor led class but feel free to ask our staff for guidance or to demonstrate an obstacle.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $15 per person</p><p></p><p><b>Friday Night Ninjas</b></p><p>Drop the kids off or stay and watch as they burn off some energy conquering the course. The high-energy obstacles will engage their bodies and minds. The course gives them the opportunity to challenge their friends, learn new skills, and improve their fitness level. Every Friday night we have a speed course challenge. The winner earns a FREE open gym pass!</p><p>Ages 5-14 $15 per person</p><p>7:00pm-9:00pm</p><p>Speed Course Challenge 8:00pm</p><p></p><p><b>Saturday Family Play</b></p><p>Looking for something fun for the family on Saturday&#x27;s? Come challenge them on the speed course, try new obstacles, or even learn new skills. Enjoy free reign of all our facility has to offer.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $10 per person</p><p>9:00am-12:00pm</p><p>5:00pm-7:00pm</p><p></p><p><b>Parties</b></p><p>Let us host your event! We offer parties for ages 4 and up for any occasion. The party host and their friends will discover their inner ninja as they challenge themselves on our many obstacles. Enjoy an exclusive or non-exclusive hour and 15 minutes of play and 30 minutes for cakes and gifts.</p><p>Our party staff will take care of everything from set-up to clean-up. Our 5:00pm parties only include set-up and share the facility with open gym attendees. All parties include cake, paper goods, drinks, and goody bags!!</p><p>Costs for exclusive parties at 1:00pm and 3:00pm: $299+ tax total for 1-15 children, $10 for each additional child. $100 minimum deposit at booking.</p><p>Costs for non-exclusive parties at 5:00pm: $225+ tax total for 1-15 children, $10 for each additional child. $100 minimum deposit at booking.</p><p></p><p><b>Field Trips/Team Building</b></p><p>Our field trips allow students, staff, team etc. to be active and engaged while using their muscles and brains to complete obstacles for their level. The obstacles and courses offer a unique and safe environment to build confidence and self esteem, while benefiting their health. Be a ninja for a couple hours.</p><p></p><p>Our team building will help you grow with your team as you work together to overcome obstacles and learn to conquer challenges. Our crew will bring you a challenge and provide you with tools. Our unique obstacles and environment give your team the opportunity to step out of their comfort zone, think outside the box, and feel the satisfaction of succeeding together.</p><p></p>"}]	12	[{"type": "schedule", "id": "6af1d2a1-6f5e-4205-b91c-7fc3a444e9f2", "value": {"times": "9:30-12:00; 13:00-16:00", "day": "MONDAY", "category": "Open Gym"}}, {"type": "schedule", "id": "6acca39d-aed7-413c-9847-11caf837f5e8", "value": {"times": "9:30-12:00; 13:00-16:00", "day": "TUESDAY", "category": "Open Gym"}}, {"type": "schedule", "id": "6396629d-7d09-465b-9d6e-5dfee169bcce", "value": {"times": "9:30-12:00;13:00-16:00", "day": "WEDNESDAY", "category": "Open Gym"}}, {"type": "schedule", "id": "aa34d0bc-3101-4925-b108-507df99b1dbe", "value": {"times": "9:30-12:00;13:00-16:00", "day": "THURSDAY", "category": "Open Gym"}}, {"type": "schedule", "id": "853cd288-1eec-4696-961a-6e860480ca1a", "value": {"times": "9:30-12:00;13:00-19:00;19:00-21:00", "day": "FRIDAY", "category": "Open Gym"}}, {"type": "schedule", "id": "d1764d65-3104-40e0-a592-044e7279d9eb", "value": {"times": "9:00-12:00;17:00-19:00", "day": "SATURDAY", "category": "Open Gym"}}]
12	For Kids & Adults	Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying.	[{"type": "paragraph_block", "id": "37cae8c5-745c-404a-81e3-d2ad1c99dcf7", "value": "<p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying. Motus Fit focuses on increasing movement, balance, and coordination. We strive to get you to your full mobility using your body weight, resistance bands, med balls, jump ropes, and more. Life is about the go and the experiences along the way.</p><p>LIVE MORE!</p><p></p><p><b>Motus Fit</b></p><p>Motus Fit is a high intensity interval workout. Every session combines a variety of movements from many disciplines to create an engaging and challenging workout. Our instructors ensure guidance, scaling, and customization to accommodate any skill level. The unique environment and equipment make your workout feel more like playing around. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p></p><p></p><p><b>Motus Fit Kids (8-17)</b></p><p>Kids just want to have fun and it is possible to show them how to enjoy exercise while improving their health and fitness. Our high-energy instructors will motivate your child through a workout that combines movements from calisthenics, ninja warrior, endurance training, and more. Obstacles will be used to build balance, coordination, confidence, and strength. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p></p>"}]	14	[{"type": "schedule", "id": "801cd71a-710e-4732-bbbf-f2f85b632dec", "value": {"times": "9:15-10:15;12:00-13:00", "day": "FRIDAY", "category": "Motus Fit"}}, {"type": "schedule", "id": "632396c8-8bd5-41c6-980c-73668a80a24e", "value": {"times": "16:00-17:00", "day": "THURSDAY", "category": "Motus Fit Kids"}}, {"type": "schedule", "id": "2b6d9e64-9bf0-4f55-b302-28e2787bea3b", "value": {"times": "9:15-10:15;12:00-13:00;17:00-18:00;18:00-19:00;19:00-20:00", "day": "THURSDAY", "category": "Motus Fit"}}, {"type": "schedule", "id": "b6e5c5c9-47d0-4255-a1c4-3bf1797bcfe3", "value": {"times": "16:00-17:00", "day": "WEDNESDAY", "category": "Motus Fit Kids"}}, {"type": "schedule", "id": "b22169cb-a2fa-40b3-99b1-24890b586014", "value": {"times": "9:15-10:15;12:00-13:00;17:00-18:00;18:00-19:00", "day": "WEDNESDAY", "category": "Motus Fit"}}, {"type": "schedule", "id": "ad904b14-e04d-4378-b74c-f2cadd336dcb", "value": {"times": "16:00-17:00", "day": "TUESDAY", "category": "Motus Fit Kids"}}, {"type": "schedule", "id": "61e60a97-3d73-4934-b8e0-ecd7216a94a5", "value": {"times": "9:15-10:15;12:00-13:00;17:00-18:00;18:00-19:00", "day": "TUESDAY", "category": "Motus Fit"}}, {"type": "schedule", "id": "2b6ec869-de1f-4fd2-8a2e-bc51cccfad3f", "value": {"times": "16:00-17:00", "day": "MONDAY", "category": "Motus Fit Kids"}}, {"type": "schedule", "id": "562993ac-1d6d-4043-91d4-85cf8ebabcf3", "value": {"times": "9:15-10:15;12:00-13:00;17:00-18:00;18:00-19:00", "day": "MONDAY", "category": "Motus Fit"}}]
13	Weekly class	Our classes will help kids build confidence by overcoming fears and challenges. All while having fun and staying active.	[{"type": "paragraph_block", "id": "263bcbb8-cfd7-4536-9aa8-4fa7f8f5c138", "value": "<p>Homeschool Motus Kids offers a variety of Ninja Warrior classes for ages 4-17. Our classes will help kids build confidence by overcoming fears and challenges. All while having fun and staying active.</p><p></p><ul><li><b>Homeschool Ninjas</b>: Your child will learn the skills they need to master balance, agility, strength and their overall fitness level - all while having a blast doing it! Every week, our instructors will put together fun new courses to keep things interesting and challenging. Your child will learn basic moves for safety, developmental progressions for skills, conditioning to take them to the next level. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</li></ul>"}]	15	[{"type": "schedule", "id": "638aed14-bb15-4e7c-9371-23f975a11d8e", "value": {"times": "14:00-15:00;15:00-16:00", "day": "THURSDAY", "category": "HS Beginner (7-17)"}}, {"type": "schedule", "id": "ac5588cd-70ac-4156-93b4-8407ef847bea", "value": {"times": "16:00-17:00", "day": "WEDNESDAY", "category": "HS Advanced (10-17)"}}, {"type": "schedule", "id": "ef76a77b-b073-4dd4-bf14-efc7b6b08551", "value": {"times": "14:00-15:00;15:00-16:00", "day": "WEDNESDAY", "category": "HS Beginner (7-17)"}}, {"type": "schedule", "id": "dfda7400-fa95-45e0-adca-d3eac21f2a8a", "value": {"times": "14:00-15:00;15:00-16:00", "day": "WEDNESDAY", "category": "HS Mini Ninja (4-6)"}}, {"type": "schedule", "id": "5ed2542c-dc3e-4a3b-a5d7-daf2f76f4291", "value": {"times": "15:00-16:00", "day": "TUESDAY", "category": "HS Beginner (7-17)"}}, {"type": "schedule", "id": "87fa6214-07f7-4ced-8e6f-2f6440a95d8b", "value": {"times": "14:00-15:00", "day": "TUESDAY", "category": "HS Mini Ninja (4-6)"}}, {"type": "schedule", "id": "c6c873e3-9b56-4028-8c3a-837eec01f9bf", "value": {"times": "14:00-15:00;15:00-16:00", "day": "MONDAY", "category": "HS Beginner (7-17)"}}]
11	For Kids & Adults	Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!	[{"type": "paragraph_block", "id": "a868084c-9e3f-4516-84c7-20321eb4980a", "value": "<p>Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!</p><p></p><ul><li><b>Mini Ninjas (Ages 4-5)</b></li></ul><p>Bring your four and five-year-olds to burn energy while gaining balance and coordination. Our Mini Ninja classes give your kiddos a unique opportunity to take on Ninja Warrior obstacles their size. They will feel like an American Ninja Warrior while racing against time on our speed course. Your little warrior will learn to control their body like a ninja in a safe, fun, and structured environment.</p><p></p><ul><li><b>Intro to Ninja: Parent and Child (ages 4-15)</b></li></ul><p>Our Intro class allows parents and children to move at their own pace while learning ninja obstacles and techniques. This is an instructor led class, but parents and children will help teach each other by working through the obstacles together with the guidance of the instructor.</p><p></p><p></p><ul><li><b>Ninja Warriors (Ages 6-15)</b></li></ul><p>Our classes are designed to help kids burn energy while gaining balance, strength and coordination. The course offers a unique opportunity to build confidence while overcoming challenges. They will feel like an American Ninja Warrior while racing against time on our speed course. Our ninjas will learn to conquer the course through obstacle progression and skill development. Classes will also focus on increasing strength and agility. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</p><p></p><ul><li><b>Adult Ninja Warrior (Ages 16+)</b></li></ul><p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying.</p><p>Our Ninja Instructors will guide you through moves for safety, developmental progressions for obstacles, and conditioning to take you to the next level. As you gain better mobility through our program you will enjoy more adventures in life. Whether you want to compete, stay in shape, or just have fun, we are there to make sure you succeed!</p>"}]	13	[{"type": "schedule", "id": "30b81389-39fb-4689-909f-ef19ff51b546", "value": {"times": "18:00-19:00;19:00-20:00", "day": "THURSDAY", "category": "Adult Ninja Warrior"}}, {"type": "schedule", "id": "a0a31cc1-a665-4e27-a748-9ec1d27a3761", "value": {"times": "17:00-18:00;18:00-19:00;19:00-20:00", "day": "THURSDAY", "category": "Ninja Warrior (6-15)"}}, {"type": "schedule", "id": "d1a80711-86fe-4b06-88dd-f7230d72125a", "value": {"times": "17:00-18:00;18:00-19:00;19:00-20:00", "day": "THURSDAY", "category": "Mini Ninja"}}, {"type": "schedule", "id": "4ec28e1a-56c5-45c5-800c-f035c9493489", "value": {"times": "17:00-18:00;18:00-19:00;19:00-20:00", "day": "WEDNESDAY", "category": "Ninja Warrior (6-15)"}}, {"type": "schedule", "id": "5cd6d8d7-686b-4d35-88b1-91ea159a3b0e", "value": {"times": "17:00-18:00;18:00-19:00", "day": "WEDNESDAY", "category": "Mini Ninja"}}, {"type": "schedule", "id": "08149a71-437c-47a4-8804-e9ea466b6b0c", "value": {"times": "18:00-19:00;19:00-20:00", "day": "TUESDAY", "category": "Adult Ninja Warrior"}}, {"type": "schedule", "id": "35f48c2f-ee84-4dbe-af4f-bca3a3295b32", "value": {"times": "17:00-18:00;18:00-19:00;19:00-20:00", "day": "TUESDAY", "category": "Ninja Warrior (6-15)"}}, {"type": "schedule", "id": "eccb9fd4-212b-4d46-afd4-92606f6f6a7b", "value": {"times": "17:00-18:00;18:00-19:00;19:00-20:00", "day": "TUESDAY", "category": "Mini Ninja"}}, {"type": "schedule", "id": "746a3c08-9a3e-4ca8-83f9-0498b0399805", "value": {"times": "17:00-18:00;18:00-19:00;19:00-20:00", "day": "MONDAY", "category": "Ninja Warrior (6-15)"}}, {"type": "schedule", "id": "7ab79e77-7ead-44dd-a20f-8cf52ed2198c", "value": {"times": "17:00-18:00;18:00-19:00", "day": "MONDAY", "category": "Mini Ninja"}}]
