8	Trisha	Trisha has been a part of the Motus Crew since 2017. She has a Bachelor's Degree in Business Administration from the University of Central Missouri.	Director of Operations	[{"type": "paragraph_block", "id": "a62efcbc-b401-4345-bb15-5387b4575c95", "value": "<p>Trisha has been a part of the Motus Crew since 2017. She has her Bachelor&#x27;s Degree in Business Administration from the University of Central Missouri. She is dedicated to ensuring Motus is well-coordinated and productive by managing its procedures and coaching its people.<br/>Trisha is also a ninja and fitness instructor and helps students aspire to reach their goals and dreams in the gym and outside of the gym. She coached Junior Olympic gymnastics for 6 years and was a competitive athlete in her youth. She has witnessed the benefits of fitness and healthy living in individuals of all backgrounds. Each day, she strives to facilitate those benefits for Motus\\u2019 diverse programs by promoting a supportive, inspired environment.</p>"}]	19
22	Randi Owens	Randi has been with Motus since 2018.	Ninja Instructor	[{"type": "paragraph_block", "id": "e00ca65a-3b32-449e-979a-69651398ae8a", "value": "<p></p><p><b>Favorite Obstacles:</b> The ring slider, unstable bridge, and the iconic warped wall!</p><p><b>Hobbies:</b> Climbing, Drawing, and Rock/Mineral Collecting</p><p><b>Passions:</b> Protecting and appreciating nature and wildlife, promoting positivity, kindness, growth, being knowledgeable in all that she does, and always making time for her friends and family.</p>"}]	26
21	TJ	After owning Xtreme Gymnastics for 15+ years Tj decided launch Motus Ninja Warrior.	CEO	[{"type": "paragraph_block", "id": "be664720-8b50-4891-9580-fec5db21632d", "value": "<p>As owner of Motus Ninja Warrior and Xtreme Gymnastics, TJ has invested over two decades to the athletic development of gymnastics; coaching at the elite level with the integrity of developing character through athletics. His combined passion for adventure and wellness has led to his innovative launch of Motus Ninja Warrior, where movement is the foundation of living better. He dreams on a grand scale with a competitive mindset in and out of the gym. He thrives on continuous improvement with an authentic fortitude to help others succeed. TJ is an alumnus of the University of Missouri Kansas City and has been instrumental in his community\\u2019s legislative changes that protect the sports industry.</p>"}]	25
17	Donovan	Donovan has been a part of the Motus Crew since 2017 and is a 6 time American Ninja Warrior.	Ninja Warrior Program Director	[{"type": "paragraph_block", "id": "a9f10318-bbc8-4a51-bfb0-757298fd3643", "value": "<p>Metoyer is a 6 time American Ninja Warrior contestant and Season 9 Vegas Finalist! Born and raised in Kansas City, MO, he developed many of his talents here: parkour (before it was a thing), basketball, track and field, computer programming and acting. He\\u2019s pretty much a jack-of-all-trades! Armed with an associate\\u2019s in computer science and a 2nd Degree Black Belt in Taekwondo, he has a knack for creating course layouts from CAD software and the discipline needed to make sure everything flows, like water.<br/></p>"}]	11
\.


