244	f	2019-01-25 19:33:04.000065+00	{"role": "CEO", "name": "TJ", "go_live_at": null, "expire_at": null, "last_published_at": "2018-09-19T17:46:01.036Z", "show_in_menus": false, "header_image": 25, "slug": "tj-el-maestro", "latest_revision_created_at": "2018-09-20T14:45:29.015Z", "expired": false, "title": "TJ Rehak", "content_type": 18, "path": "0001000200020003", "live_revision": 164, "desc": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"be664720-8b50-4891-9580-fec5db21632d\\", \\"value\\": \\"<p>As owner of Motus Ninja Warrior and Xtreme Gymnastics, TJ has invested over two decades to the athletic development of gymnastics; coaching at the elite level with the integrity of developing character through athletics. His combined passion for adventure and wellness has led to his innovative launch of Motus Ninja Warrior, where movement is the foundation of living better. He dreams on a grand scale with a competitive mindset in and out of the gym. He thrives on continuous improvement with an authentic fortitude to help others succeed. TJ is an alumnus of the University of Missouri Kansas City and has been instrumental in his community\\\\u2019s legislative changes that protect the sports industry.</p>\\"}]", "locked": false, "live": false, "intro": "After owning Xtreme Gymnastics for 15+ years Tj decided launch Motus Ninja Warrior.", "draft_title": "TJ Rehak", "url_path": "/index/motus-crew/tj-el-maestro/", "seo_title": "", "first_published_at": "2018-09-18T15:36:00.113Z", "has_unpublished_changes": true, "pk": 21, "search_description": "", "depth": 4, "categories": [2, 3], "numchild": 0, "owner": 1}	\N	21	2
271	f	2019-03-12 16:56:45.958875+00	{"pk": 20, "path": "0001000200030004", "search_description": "Motus Ninja Warrior Grand Opening", "url_path": "/index/activities/grand-opening/", "live_revision": 270, "post_tags": [], "title": "Motus Ninja Competition", "last_published_at": "2019-03-06T23:21:56.143Z", "slug": "grand-opening", "has_unpublished_changes": false, "numchild": 0, "live": true, "intro": "DO YOU HAVE WHAT IT TAKES TO CONQUER MOTUS?", "owner": 1, "categories": [1, 2], "seo_title": "", "first_published_at": "2018-09-17T19:05:58.100Z", "header_image": 31, "date": "2018-09-15", "go_live_at": null, "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"6548ede5-5c3f-48e4-80ce-24ebe3f4abe4\\", \\"value\\": \\"<p><b>Date:</b> April 27th &amp; 28th</p><p><b>Kids:</b> 04/27/19</p><p><b>Adults:</b> 04/28/19</p><p><b>Competition System:</b> Point</p><p><b>Max Competitors:</b> 30 (For each age group)</p><p><b>Entry Fee:</b> Kids / Teens $50 Adults: $60</p><p><b>Sign-up Deadline:</b> 4/14/19</p><p><b>Adult Prizes: 1st</b> - $150<b> 2nd</b> - $100 <b>3rd</b> - $60</p><p><b>Kid Prizes:</b> <b> TBA</b></p><p></p><p><b>KIDS</b></p><p>All competitors will run Stage 1 and Stage 2.</p><p>A combination of Points and Time will determine 1st, 2nd and 3rd place.</p><p><b>Stage 1 Group times</b></p><p>6-7 years check-in time/warm-up: 9AM-9:15AM</p><p>6-7 years course rules: 9:15AM-9:20AM</p><p>6-7 years run start: 9:20AM</p><p>8-10 years check-in time/warm-up: 12:00PM-12:15PM</p><p>8-10 years course rules: 12:15PM-12:20PM</p><p>8-10 years runs start: 12:20PM</p><p>11-13 years check-in time/warm-up: 3:00PM-3:15PM</p><p>11-13 years course rules: 3:15PM-3:20PM</p><p>11-13 years runs start: 3:20PM</p><p>14-17 years check-in time/warm-up: 6:00PM-6:15PM</p><p>14-17 years course rules: 6:15PM-6:20PM</p><p>14-17 years runs start: 6:20PM</p><p><b>Stage 2 Group times</b></p><p>6-7 years Course rules individually as Stage 1 is completed</p><p>6-7 years Runs start after rules</p><p>6-7 years Award 11:30PM</p><p>8-10 years Course rules individually as Stage 1 is completed</p><p>8-10 years Runs start after rules</p><p>8-10 years Award 2:30PM</p><p>11-13 years Course rules individually as Stage 1 is completed</p><p>11-13 years Runs start after rules</p><p>11-13 years Award 5:30PM</p><p>14-17 years Course rules individually as Stage 1 is completed</p><p>14-17 years Runs start after rules</p><p>14-17 years Award 8:30PM</p><p></p><p><b>ADULTS</b></p><p>All competitors will run Stage 1 and Stage 2.</p><p>A combination of Points and Time will determine 1st, 2nd and 3rd place.</p><p><b>Stage 1 times</b></p><p>Adults check-in time/warm-up: 2PM-2:15PM</p><p>Adults course rules: 2:20PM</p><p>Adults run start: 2:30PM</p><p><b>Stage 2 times</b></p><p>Course rules individually as Stage 1 is completed</p><p>Runs start after rules</p><p>Awards 5:00PM</p><p></p><p><b>Stage 1</b></p><p>Points Per Obstacle Completed: 1</p><p>Competitors will receive 1 Point for each obstacle they complete.</p><p>Completing the same obstacle twice will NOT result in more points.</p><p>If an obstacle is failed and there is time remaining on the clock, the competitor may attempt the obstacles again, from the beginning, as many times as needed to obtain a point.</p><p>If a competitor is in the middle of an obstacle and times expires, that obstacle will be considered failed.</p><p>Points will carry-over to Stage 2.</p><p><b>Stage 2</b></p><p>Points Per Obstacle Completed: 1</p><p>Competitors will receive 1 Point for each obstacle they complete.</p><p>Competitors will NOT receive multiple attempts on any obstacle.</p><p>Once an obstacle is failed, they must move on to the next obstacle.</p><p>Competitors may take a 15 second break/rest after completing or failing an obstacle.</p><p></p><p>Email or visit our website to reserve your spot today!</p><p>info@motusninjawarrior.com</p><p><a href=\\\\\\"https://app.iclasspro.com/parentportal/motus\\\\\\">https://app.iclasspro.com/parentportal/motus</a></p>\\"}]", "draft_title": "Motus Ninja Competition", "expired": false, "depth": 4, "show_in_menus": false, "locked": false, "latest_revision_created_at": "2019-03-06T23:21:56.100Z", "expire_at": null, "content_type": 7}	\N	20	2
233	f	2019-01-25 19:29:01.967074+00	{"go_live_at": null, "expire_at": null, "featured_section_2": 6, "last_published_at": "2019-01-25T19:26:10.777Z", "promo_text": "", "show_in_menus": false, "featured_section_3_title": "Motus Crew", "hero_cta_link": 18, "slug": "index", "latest_revision_created_at": "2019-01-25T19:27:46.603Z", "expired": false, "title": "Official Website", "hero_cta": "FREE TRIAL", "content_type": 13, "image": 23, "path": "00010002", "contact_us_page": 10, "live_revision": 231, "featured_section_2_title": "Our Events", "featured_section_3": 5, "locked": false, "promo_title": null, "live": false, "promo_image": null, "hero_sub_text": "At KC\\u2019s Largest Ninja Facility", "draft_title": "Official Website", "url_path": "/index/", "seo_title": "", "featured_section_1_title": "Our Programs", "first_published_at": "2018-09-13T07:51:15.709Z", "has_unpublished_changes": true, "hero_text": "Unlock Your Inner Warrior!", "pk": 3, "search_description": "", "depth": 2, "featured_section_1": 4, "body": "<p><b>Motus is the largest ninja warrior facility in the KC Metro area housing over 240\\u2019 of obstacle course. We are designed to give the whole family a unique ninja and fitness experience. Here at Motus, we are devoted to keeping families active through movement. We are committed to keeping our courses challenging by adding new obstacles monthly.</b></p>", "numchild": 5, "owner": 1}	\N	3	2
3	f	2018-09-13 07:49:35.065535+00	{"pk": 5, "path": "0001000100010002", "depth": 4, "numchild": 0, "title": "Motus Crew", "draft_title": "Motus Crew", "slug": "motus-crew", "content_type": 17, "live": true, "has_unpublished_changes": false, "url_path": "/home/motus-web-site/motus-crew/", "owner": 1, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "intro": "[{\\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>A great place would certainly not be great without great people to run the show.</p>\\", \\"id\\": \\"26437254-c718-4d5c-ac09-de4140a6183e\\"}]"}	\N	5	1
120	f	2018-09-15 08:47:09.216098+00	{"has_unpublished_changes": false, "last_published_at": "2018-09-15T08:44:24.842Z", "body": "[{\\"id\\": \\"255fe4c9-87bf-4a19-a3b9-025b20284139\\", \\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Motus offers the most fun in Lee\\\\u2019s Summit with open gyms, parties, field trips, and team building experiences. Unlock your inner warrior on 240&#x27; of obstacle course, one of our 4 warped walls, the campus board, jumping spider, cliffhanger, or maybe even the wing nuts!</p><p></p><p><b>Daily Open Gym</b></p><p>Open gyms are perfect for burning off energy, testing your strength, conquering challenging obstacles, and having fun! You have access to our entire facility and can work at your own pace. This is not an instructor led class but feel free to ask our staff for guidance or to demonstrate an obstacle.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $15 per person</p><p></p><p><b>Friday Night Ninjas</b></p><p>Drop the kids off or stay and watch as they burn off some energy conquering the course. The high-energy obstacles will engage their bodies and minds. The course gives them the opportunity to challenge their friends, learn new skills, and improve their fitness level. Every Friday night we have a speed course challenge. The winner earns a FREE open gym pass!</p><p>Ages 5-14 $15 per person</p><p>7:00pm-9:00pm</p><p>Speed Course Challenge 8:00pm</p><p></p><p><b>Saturday Family Play</b></p><p>Looking for something fun for the family on Saturday nights? Come challenge them on the speed course, try new obstacles, or even learn new skills. Enjoy free reign of all our facility has to offer.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult)</p><p>5:00pm-7:00 pm $10 per person</p><p></p><p><b>Parties</b></p><p>Let us host your event! We offer parties for ages 4 and up for any occasion. The party host and 15 of their friends will discover their inner ninja as they challenge themselves on our many obstacles. Our party staff will take care of everything from set-up to clean-up. Parties include cake, paper goods, drinks, goody bags, and two party coaches! Enjoy an exclusive hour and 15 minutes of play and 30 minutes for cakes and gifts.</p><p>$299+ tax total for 1-15 children, $15 for each additional child. $100 minimum deposit at booking.</p><p>We offer parties every Saturday at 1:00pm and 3:00pm.</p><p></p><p><b>Field Trips/Team Building</b></p><p>Our field trips allow students, staff, team etc. to be active and engaged while using their muscles and brains to complete obstacles for their level. The obstacles and courses offer a unique and safe environment to build confidence and self esteem, while benefiting their health. Be a ninja for a couple hours.</p><p>Our team building will help you grow with your team as you work together to overcome obstacles and learn to conquer challenges. Our crew will bring you a challenge and provide you with tools. Our unique obstacles and environment give your team the opportunity to step out of their comfort zone, think outside the box, and feel the satisfaction of succeeding together.</p><p></p>\\"}]", "numchild": 0, "pk": 7, "live": true, "path": "0001000200010001", "title": "Motus Fun", "expired": false, "content_type": 12, "search_description": "", "schedule": "[{\\"id\\": \\"6af1d2a1-6f5e-4205-b91c-7fc3a444e9f2\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"MONDAY\\", \\"times\\": \\"9:30-10:30;11:00-11:45;15:00-15:45\\", \\"category\\": \\"Open Gym\\"}}]", "owner": 1, "expire_at": null, "depth": 4, "draft_title": "Motus Fun", "intro": "Motus offers the most fun in Lee\\u2019s Summit with open gyms, parties, field trips, and team building experiences.", "first_published_at": "2018-09-13T08:07:46.469Z", "sub_title": "For Kids & Adults", "show_in_menus": false, "url_path": "/index/our-programs/motus-fun/", "locked": false, "live_revision": 119, "latest_revision_created_at": "2018-09-15T08:44:24.819Z", "slug": "motus-fun", "seo_title": "", "go_live_at": null, "header_image": 12}	\N	7	1
93	f	2018-09-14 22:17:00.15004+00	{"has_unpublished_changes": false, "last_published_at": "2018-09-14T22:15:57.811Z", "body": "[{\\"id\\": \\"37cae8c5-745c-404a-81e3-d2ad1c99dcf7\\", \\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying. Motus Fit focuses on increasing movement, balance, and coordination. We strive to get you to your full mobility using your body weight, resistance bands, med balls, jump ropes, and more. Life is about the go and the experiences along the way.</p><p>LIVE MORE!</p><p></p><p><b>Motus Fit</b></p><p>Motus Fit is a high intensity interval workout. Every session combines a variety of movements from many disciplines to create an engaging and challenging workout. Our instructors ensure guidance, scaling, and customization to accommodate any skill level. The unique environment and equipment make your workout feel more like playing around. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p></p><p></p><p><b>Motus Fit Kids (8-17)</b></p><p>Kids just want to have fun and it is possible to show them how to enjoy exercise while improving their health and fitness. Our high-energy instructors will motivate your child through a workout that combines movements from calisthenics, ninja warrior, endurance training, and more. Obstacles will be used to build balance, coordination, confidence, and strength. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p></p>\\"}]", "numchild": 0, "pk": 12, "live": true, "path": "0001000200010003", "title": "Motus Fit", "expired": false, "content_type": 12, "search_description": "", "schedule": "[{\\"id\\": \\"801cd71a-710e-4732-bbbf-f2f85b632dec\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"FRIDAY\\", \\"times\\": \\"9:15am;12:00am\\