94	f	2018-09-14 22:17:03.148336+00	{"has_unpublished_changes": true, "last_published_at": "2018-09-14T22:15:57.811Z", "body": "[{\\"id\\": \\"37cae8c5-745c-404a-81e3-d2ad1c99dcf7\\", \\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying. Motus Fit focuses on increasing movement, balance, and coordination. We strive to get you to your full mobility using your body weight, resistance bands, med balls, jump ropes, and more. Life is about the go and the experiences along the way.</p><p>LIVE MORE!</p><p></p><p><b>Motus Fit</b></p><p>Motus Fit is a high intensity interval workout. Every session combines a variety of movements from many disciplines to create an engaging and challenging workout. Our instructors ensure guidance, scaling, and customization to accommodate any skill level. The unique environment and equipment make your workout feel more like playing around. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p></p><p></p><p><b>Motus Fit Kids (8-17)</b></p><p>Kids just want to have fun and it is possible to show them how to enjoy exercise while improving their health and fitness. Our high-energy instructors will motivate your child through a workout that combines movements from calisthenics, ninja warrior, endurance training, and more. Obstacles will be used to build balance, coordination, confidence, and strength. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p></p>\\"}]", "numchild": 0, "pk": 12, "live": true, "path": "0001000200010003", "title": "Motus Fit", "expired": false, "content_type": 12, "search_description": "", "schedule": "[{\\"id\\": \\"801cd71a-710e-4732-bbbf-f2f85b632dec\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"FRIDAY\\", \\"times\\": \\"9:15am;12:00am\\", \\"category\\": \\"Motus Fit\\"}}, {\\"id\\": \\"632396c8-8bd5-41c6-980c-73668a80a24e\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"THURSDAY\\", \\"times\\": \\"4:00pm\\", \\"category\\": \\"Motus Fit Kids\\"}}, {\\"id\\": \\"2b6d9e64-9bf0-4f55-b302-28e2787bea3b\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"THURSDAY\\", \\"times\\": \\"9:15am;12:00am;5:00pm;6:00pm;7:00pm\\", \\"category\\": \\"Motus Fit\\"}}, {\\"id\\": \\"b6e5c5c9-47d0-4255-a1c4-3bf1797bcfe3\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"WEDNESDAY\\", \\"times\\": \\"4:00pm\\", \\"category\\": \\"Motus Fit Kids\\"}}, {\\"id\\": \\"b22169cb-a2fa-40b3-99b1-24890b586014\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"WEDNESDAY\\", \\"times\\": \\"9:15am;12:00am;5:00pm;6:00pm;7:00pm\\", \\"category\\": \\"Motus Fit\\"}}, {\\"id\\": \\"ad904b14-e04d-4378-b74c-f2cadd336dcb\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"4:00pm\\", \\"category\\": \\"Motus Fit Kids\\"}}, {\\"id\\": \\"61e60a97-3d73-4934-b8e0-ecd7216a94a5\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"9:15am;12:00am;5:00pm;6:00pm;7:00pm\\", \\"category\\": \\"Motus Fit\\"}}, {\\"id\\": \\"2b6ec869-de1f-4fd2-8a2e-bc51cccfad3f\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"MONDAY\\", \\"times\\": \\"4:00pm\\", \\"category\\": \\"Motus Fit Kids\\"}}, {\\"id\\": \\"562993ac-1d6d-4043-91d4-85cf8ebabcf3\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"MONDAY\\", \\"times\\": \\"9:15am;12:00am;5:00pm;6:00pm;7:00pm\\", \\"category\\": \\"Motus Fit\\"}}]", "owner": 1, "expire_at": null, "depth": 4, "draft_title": "Motus Fit", "intro": "Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying.", "first_published_at": "2018-09-13T08:40:38.305Z", "sub_title": "For Kids & Adults", "show_in_menus": false, "url_path": "/index/our-programs/motus-fit/", "locked": false, "live_revision": 90, "latest_revision_created_at": "2018-09-14T22:17:00.150Z", "slug": "motus-fit", "seo_title": "", "go_live_at": null, "header_image": 14}	\N	12	2
263	f	2019-02-25 18:08:59.926667+00	{"go_live_at": null, "expire_at": null, "last_published_at": "2019-02-25T18:02:38.311Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"a868084c-9e3f-4516-84c7-20321eb4980a\\", \\"value\\": \\"<p>Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!</p><p></p><ul><li><b>Mini Ninjas(Ages 4-5)</b></li></ul><p>Bring your four and five-year-olds to burn energy while gaining balance and coordination. Our Mini Ninja classes give your kiddos a unique opportunity to take on Ninja Warrior obstacles their size. They will feel like an American Ninja Warrior while racing against time on our speed course. Your little warrior will learn to control their body like a ninja in a safe, fun, and structured environment.</p><p></p><ul><li><b>Intro to Ninja: Parent and Child (ages 4-15)</b></li></ul><p>Our Intro class allows parents and children to move at their own pace while learning ninja obstacles and techniques. This is an instructor led class, but parents and children will help teach each other by working through the obstacles together with the guidance of the instructor.</p><p></p><ul><li><b>Ninja Warriors (Ages 6-15)</b></li></ul><p>Our classes are designed to help kids burn energy while gaining balance, strength and coordination. The course offers a unique opportunity to build confidence while overcoming challenges. They will feel like an American Ninja Warrior while racing against time on our speed course. Our ninjas will learn to conquer the course through obstacle progression and skill development. Classes will also focus on increasing strength and agility. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</p><p></p><ul><li><b>Adult Ninja Warrior (Ages 16+)</b></li></ul><p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying.</p><p>Our Ninja Instructors will guide you through moves for safety, developmental progressions for obstacles, and conditioning to take you to the next level. As you gain better mobility through our program you will enjoy more adventures in life. Whether you want to compete, stay in shape, or just have fun, we are there to make sure you succeed!</p>\\"}]", "show_in_menus": false, "header_image": 13, "slug": "ninja-warriors", "latest_revision_created_at": "2019-02-25T18:02:38.281Z", "expired": false, "title": "Ninja Warriors", "content_type": 12, "path": "0001000200010002", "live_revision": 262, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"30b81389-39fb-4689-909f-ef19ff51b546\\", \\"value\\": {\\"times\\": \\"18:00-19:00;19:00-20:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"Adult Ninja Warrior\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"a0a31cc1-a665-4e27-a748-9ec1d27a3761\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"Ninja Warrior (6-15)\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"d1a80711-86fe-4b06-88dd-f7230d72125a\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"Mini Ninja\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"4ec28e1a-56c5-45c5-800c-f035c9493489\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"WEDNESDAY\\", \\"category\\": \\"Ninja Warrior (6-15)\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"5cd6d8d7-686b-4d35-88b1-91ea159a3b0e\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00\\", \\"day\\": \\"WEDNESDAY\\", \\"category\\": \\"Mini Ninja\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"08149a71-437c-47a4-8804-e9ea466b6b0c\\", \\"value\\": {\\"times\\": \\"18:00-19:00;19:00-20:00\\", \\"day\\":