83	f	2018-09-14 21:49:13.782165+00	{"has_unpublished_changes": false, "last_published_at": "2018-09-14T17:41:32.401Z", "body": "[{\\"id\\": \\"a868084c-9e3f-4516-84c7-20321eb4980a\\", \\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!</p><p></p><ul><li><b>Mini Ninjas(Ages 4-5)</b></li></ul><p>Bring your four and five-year-olds to burn energy while gaining balance and coordination. Our Mini Ninja classes give your kiddos a unique opportunity to take on Ninja Warrior obstacles their size. They will feel like an American Ninja Warrior while racing against time on our speed course. Your little warrior will learn to control their body like a ninja in a safe, fun, and structured environment.</p><p></p><ul><li><b>Ninja Warriors (Ages 6-17)</b></li></ul><p>Our classes are designed to help kids burn energy while gaining balance, strength and coordination. The course offers a unique opportunity to build confidence while overcoming challenges. They will feel like an American Ninja Warrior while racing against time on our speed course. Our ninjas will learn to conquer the course through obstacle progression and skill development. Classes will also focus on increasing strength and agility. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</p><p></p><ul><li><b>Adult Ninja Warrior (Ages 18+)</b></li></ul><p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying.</p><p>Our Ninja Instructors will guide you through moves for safety, developmental progressions for obstacles, and conditioning to take you to the next level. As you gain better mobility through our program you will enjoy more adventures in life. Whether you want to compete, stay in shape, or just have fun, we are there to make sure you succeed!</p>\\"}]", "numchild": 0, "pk": 11, "live": true, "path": "0001000200010002", "title": "Ninja Warriors", "expired": false, "content_type": 12, "search_description": "", "schedule": "[{\\"id\\": \\"5cd6d8d7-686b-4d35-88b1-91ea159a3b0e\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"WEDNESDAY\\", \\"times\\": \\"5:00;6:00\\", \\"category\\": \\"Mini Ninja\\"}}, {\\"id\\": \\"08149a71-437c-47a4-8804-e9ea466b6b0c\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"6:00;7:00\\", \\"category\\": \\"Adult Ninja Warrior\\"}}, {\\"id\\": \\"35f48c2f-ee84-4dbe-af4f-bca3a3295b32\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"5:00;6:00;7:00\\", \\"category\\": \\"Ninja Warrior (6-14)\\"}}, {\\"id\\": \\"eccb9fd4-212b-4d46-afd4-92606f6f6a7b\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"5:00;6:00;7:00\\", \\"category\\": \\"Mini Ninja\\"}}, {\\"id\\": \\"746a3c08-9a3e-4ca8-83f9-0498b0399805\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"MONDAY\\", \\"times\\": \\"5:00;6:00;7:00\\", \\"category\\": \\"Ninja Warrior (6-17)\\"}}, {\\"id\\": \\"7ab79e77-7ead-44dd-a20f-8cf52ed2198c\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"MONDAY\\", \\"times\\": \\"5:00;6:00\\", \\"category\\": \\"Mini Ninja\\"}}]", "owner": 1, "expire_at": null, "depth": 4, "draft_title": "Ninja Warriors", "intro": "Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!", "first_published_at": "2018-09-13T08:37:20.434Z", "sub_title": "For Kids & Adults", "show_in_menus": false, "url_path": "/index/our-programs/ninja-warriors/", "locked": false, "live_revision": 52, "latest_revision_created_at": "2018-09-14T17:41:32.363Z", "slug": "