149	f	2018-09-18 17:03:40.664384+00	{"name": "TJ", "role": "CEO", "live": true, "categories": [1, 2, 3], "depth": 4, "locked": false, "path": "0001000200020003", "pk": 21, "url_path": "/index/motus-crew/tj-el-maestro/", "expire_at": null, "desc": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"be664720-8b50-4891-9580-fec5db21632d\\", \\"value\\": \\"<p>After spending 20+ years in the gymnastics coaching at the highest level, I decided to expand my love on of the sport of gymnastics to Ninja Warrior. Ninja Warrior combines my passion for movement and fitness into one activity. I always have this dream of obstacle courses training to get fit.</p>\\"}]", "latest_revision_created_at": "2018-09-18T15:41:33.025Z", "owner": 1, "intro": "TJ is the founder of xtreme gymnastics and he made the bold decision to launch our new ninja club Motus Ninja Warrior.", "first_published_at": "2018-09-18T15:36:00.113Z", "live_revision": 148, "content_type": 18, "show_in_menus": false, "last_published_at": "2018-09-18T15:41:33.047Z", "seo_title": "", "draft_title": "TJ (il Maestro)", "search_description": "", "go_live_at": null, "slug": "tj-el-maestro", "numchild": 0, "title": "TJ CEO", "expired": false, "header_image": 25, "has_unpublished_changes": false}	\N	21	2
267	f	2019-03-01 06:33:20.877215+00	{"body": "[{\\"id\\": \\"8aabb4a9-d031-4e3c-be57-b042cafb7b6d\\", \\"value\\": \\"<ol><li>Select Parent Portal Tab on xgtkids.com</li><li>If you are new to the Xtreme Gymnastics create an account and log in</li><li>Once logged in, select the \\\\u201cstudent tab\\\\u201d on the left menu bar:</li></ol>\\", \\"type\\": \\"paragraph_block\\"}, {\\"id\\": \\"b7966216-d4cb-47c6-b205-43ba444b65d2\\", \\"value\\": {\\"image\\": 42, \\"caption\\": \\"\\", \\"attribution\\": \\"\\"}, \\"type\\": \\"image_block\\"}, {\\"id\\": \\"fd45ba13-002e-474c-9c66-0cfb2197a19a\\", \\"value\\": \\"<p>   4.  Add Student information - Once a student is added, select \\\\u201cEnroll in classes\\\\u201d</p>\\", \\"type\\": \\"paragraph_block\\"}, {\\"id\\": \\"f6418498-8865-4e79-8f95-0a0c2b04f7a4\\", \\"value\\": {\\"image\\": 43, \\"caption\\": \\"\\", \\"attribution\\": \\"\\"}, \\"type\\": \\"image_block\\"}, {\\"id\\": \\"41ba6e99-2ecb-4b4a-bac8-c9d68edbcf85\\", \\"value\\": \\"<p>5.  Use the filters at the top to narrow down class selection</p><ul><li>On the left you will see if a class is open, on the right will be the option to submit a trial request</li><li>Once the class has been selected, click on the \\\\u201cSubmit Request\\\\u201d button</li></ul>\\", \\"type\\": \\"paragraph_block\\"}]", "numchild": 0, "image": null, "live_revision": null, "show_in_menus": false, "go_live_at": null, "url_path": "/index/free-trial/", "live": false, "path": "000100020006", "draft_title": "Free Trial", "locked": false, "title": "Free Trial", "pk": 30, "search_description": "", "owner": 1, "seo_title": "", "depth": 3, "introduction": "Thank your for trying our Motus program!", "has_unpublished_changes": false, "last_published_at": null, "content_type": 14, "first_published_at": null, "slug": "free-trial", "expire_at": null, "expired": false, "latest_revision_created_at": null}	\N	30	1
89	f	2018-09-14 22:15:53.58149+00	{"has_unpublished_changes": false, "last_published_at": "2018-09-14T17:56:00.690Z", "body": "[{\\"id\\": \\"37cae8c5-745c-404a-81e3-d2ad1c99dcf7\\", \\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying. Motus Fit focuses on increasing movement, balance, and coordination. We strive to get you to your full mobility using your body weight, resistance bands, med balls, jump ropes, and more. Life is about the go and the experiences along the way.</p><p>LIVE MORE!</p><p></p><p><b>Motus Fit</b></p><p>Motus Fit is a high intensity interval workout. Every session combines a variety of movements from many disciplines to create an engaging and challenging workout. Our instructors ensure guidance, scaling, and customization to accommodate any skill level. The unique environment and equipment make your workout feel more like playing around. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p></p><p></p><p><b>Motus Fit Kids (8-17)</b></p><p>Kids just want to have fun and it is possible to show them how to enjoy exercise while improving their health and fitness. Our high-energy instructors will motivate your child through a workout that combines movements from calisthenics, ninja warrior, endurance training, and more. Obstacles will be used to build balance, coordination, confidence, and strength. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p></p>\\"}]", "numchild": 0, "pk": 12, "live": true, "path": "0001000200010003", "title": "Motus Fit", "expired": false, "content_type": 12, "search_description": "", "schedule": "[{\\"id\\": \\"801cd71a-710e-4732-bbbf-f2f85b632dec\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"FRIDAY\\", \\"times\\": \\"9:15am;12:00pm\\