121	f	2018-09-15 08:54:20.977772+00	{"depth": 4, "show_in_menus": false, "path": "0001000200010001", "body": "[{\\"value\\": \\"<p>Motus offers the most fun in Lee\\\\u2019s Summit with open gyms, parties, field trips, and team building experiences. Unlock your inner warrior on 240&#x27; of obstacle course, one of our 4 warped walls, the campus board, jumping spider, cliffhanger, or maybe even the wing nuts!</p><p></p><p><b>Daily Open Gym</b></p><p>Open gyms are perfect for burning off energy, testing your strength, conquering challenging obstacles, and having fun! You have access to our entire facility and can work at your own pace. This is not an instructor led class but feel free to ask our staff for guidance or to demonstrate an obstacle.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $15 per person</p><p></p><p><b>Friday Night Ninjas</b></p><p>Drop the kids off or stay and watch as they burn off some energy conquering the course. The high-energy obstacles will engage their bodies and minds. The course gives them the opportunity to challenge their friends, learn new skills, and improve their fitness level. Every Friday night we have a speed course challenge. The winner earns a FREE open gym pass!</p><p>Ages 5-14 $15 per person</p><p>7:00pm-9:00pm</p><p>Speed Course Challenge 8:00pm</p><p></p><p><b>Saturday Family Play</b></p><p>Looking for something fun for the family on Saturday nights? Come challenge them on the speed course, try new obstacles, or even learn new skills. Enjoy free reign of all our facility has to offer.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult)</p><p>5:00pm-7:00 pm $10 per person</p><p></p><p><b>Parties</b></p><p>Let us host your event! We offer parties for ages 4 and up for any occasion. The party host and 15 of their friends will discover their inner ninja as they challenge themselves on our many obstacles. Our party staff will take care of everything from set-up to clean-up. Parties include cake, paper goods, drinks, goody bags, and two party coaches! Enjoy an exclusive hour and 15 minutes of play and 30 minutes for cakes and gifts.</p><p>$299+ tax total for 1-15 children, $15 for each additional child. $100 minimum deposit at booking.</p><p>We offer parties every Saturday at 1:00pm and 3:00pm.</p><p></p><p><b>Field Trips/Team Building</b></p><p>Our field trips allow students, staff, team etc. to be active and engaged while using their muscles and brains to complete obstacles for their level. The obstacles and courses offer a unique and safe environment to build confidence and self esteem, while benefiting their health. Be a ninja for a couple hours.</p><p>Our team building will help you grow with your team as you work together to overcome obstacles and learn to conquer challenges. Our crew will bring you a challenge and provide you with tools. Our unique obstacles and environment give your team the opportunity to step out of their comfort zone, think outside the box, and feel the satisfaction of succeeding together.</p><p></p>\\", \\"type\\": \\"paragraph_block\\", \\"id\\": \\"255fe4c9-87bf-4a19-a3b9-025b20284139\\"}]", "locked": false, "title": "Motus Fun", "url_path": "/index/our-programs/motus-fun/", "sub_title": "For Kids & Adults", "draft_title": "Motus Fun", "owner": 1, "seo_title": "", "content_type": 12, "expire_at": null, "intro": "Motus offers the most fun in Lee\\u2019s Summit with open gyms, parties, field trips, and team building experiences.", "live": true, "last_published_at": "2018-09-15T08:47:09.240Z", "schedule": "[{\\"value\\": {\\"times\\": \\"9:30-12:00;13:00-17:00\\", \\"day\\": \\"MONDAY\\", \\"category\\": \\"Open Gym\\"}, \\"type\\": \\"schedule\\", \\"id\\": \\"6af1d2a1-6f5e-4205-b91c-7fc3a444e9f2\\"}, {\\"value\\": {\\"times\\": \\"9:30-12:00;13:00-19:00\\", \\"day\\": \\"TUESDAY\\", \\"category\\": \\"Open Gym\\"}, \\"type\\": \\"schedule\\", \\"id\\": \\"6acca39d-aed7-413c-9847-11caf837f5e8\\"}, {\\"value\\": {\\"times\\":