144	f	2018-09-18 15:40:27.485224+00	{"name": "TJ", "role": "Maestro", "live": true, "categories": [1, 2, 3], "depth": 4, "locked": false, "path": "0001000200020003", "pk": 21, "url_path": "/index/motus-crew/tj-el-maestro/", "expire_at": null, "desc": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"be664720-8b50-4891-9580-fec5db21632d\\", \\"value\\": \\"<p>After spending 20+ years in the gymnastics coaching at the highest level, I decided to expand my love on of the sport of gymnastics to Ninja Warrior. Ninja Warrior combines my passion for movement and fitness into one activity. I always have this dream of obstacle courses training to get fit.</p>\\"}]", "latest_revision_created_at": "2018-09-18T15:39:52.123Z", "owner": 1, "intro": "TJ is the founder of xtreme gymnastics and he made the bold decision to launch our new ninja club Motus Ninja Warrior.", "first_published_at": "2018-09-18T15:36:00.113Z", "live_revision": 143, "content_type": 18, "show_in_menus": false, "last_published_at": "2018-09-18T15:39:52.145Z", "seo_title": "", "draft_title": "TJ (il Maestro)", "search_description": "", "go_live_at": null, "slug": "tj-el-maestro", "numchild": 0, "title": "TJ (il Maestro)", "expired": false, "header_image": 25, "has_unpublished_changes": false}	\N	21	1
