our many obstacles. Our party staff will take care of everything from set-up to clean-up. Parties include cake, paper goods, drinks, goody bags, and two party coaches! Enjoy an exclusive hour and 15 minutes of play and 30 minutes for cakes and gifts.</p><p>$299+ tax total for 1-15 children, $15 for each additional child. $100 minimum deposit at booking.</p><p>We offer parties every Saturday at 1:00pm and 3:00pm.</p><p></p><p><b>Field Trips/Team Building</b></p><p>Our field trips allow students, staff, team etc. to be active and engaged while using their muscles and brains to complete obstacles for their level. The obstacles and courses offer a unique and safe environment to build confidence and self esteem, while benefiting their health. Be a ninja for a couple hours.</p><p>Our team building will help you grow with your team as you work together to overcome obstacles and learn to conquer challenges. Our crew will bring you a challenge and provide you with tools. Our unique obstacles and environment give your team the opportunity to step out of their comfort zone, think outside the box, and feel the satisfaction of succeeding together.</p><p></p>\\"}]", "numchild": 0, "pk": 7, "live": true, "path": "0001000200010001", "title": "Motus Fun", "expired": false, "content_type": 12, "search_description": "", "schedule": "[{\\"id\\": \\"8e9b1dba-02eb-4ddd-bd12-27ff0992ad4f\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"FRIDAY\\", \\"times\\": \\"9:30am-noon\\", \\"category\\": \\"Open Gym\\"}}, {\\"id\\": \\"f0638b30-2f9d-4b96-a491-45c7e3a682d3\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"FRIDAY\\", \\"times\\": \\"1:00pm\\", \\"category\\": \\"until 7pm Open Gym\\"}}]", "owner": 1, "expire_at": null, "depth": 4, "draft_title": "Motus Fun", "intro": "Motus offers the most fun in Lee\\u2019s Summit with open gyms, parties, field trips, and team building experiences.", "first_published_at": "2018-09-13T08:07:46.469Z", "sub_title": "For Kids & Adult