154	f	2018-09-18 19:36:41.963846+00	{"featured_section_1": 4, "featured_section_3": 5, "live": true, "hero_cta_link": 18, "depth": 2, "locked": false, "path": "00010002", "hero_cta": "FREE TRIAL", "promo_image": null, "pk": 3, "url_path": "/index/", "expire_at": null, "latest_revision_created_at": "2018-09-14T23:06:10.362Z", "hero_text": "Unlock Your Inner Warrior!", "contact_us_page": 10, "owner": 1, "image": 23, "promo_title": null, "first_published_at": "2018-09-13T07:51:15.709Z", "live_revision": 109, "content_type": 13, "show_in_menus": false, "promo_text": "<p></p>", "last_published_at": "2018-09-14T23:06:10.416Z", "seo_title": "", "featured_section_2_title": "Our Events", "featured_section_3_title": "Motus Crew", "draft_title": "Motus Web Site", "search_description": "", "featured_section_2": 6, "body": "<p><b>Motus is the largest ninja warrior facility in the KC Metro area housing over 240\\u2019 of obstacle course. We are designed to give the whole family a unique ninja and fitness experience. Here at Motus, we are devoted to keeping families active through movement. We are committed to keeping our courses challenging by adding new obstacles monthly.</b></p>", "go_live_at": null, "slug": "index", "numchild": 5, "title": "Motus Ninja Warrior", "featured_section_1_title": "Our Programs", "expired": false, "has_unpublished_changes": false, "hero_sub_text": "At KC\\u2019s Largest Ninja Facility"}	\N	3	1
99	f	2018-09-14 22:24:04.87314+00	{"has_unpublished_changes": false, "last_published_at": "2018-09-14T22:21:39.059Z", "body": "[{\\"id\\": \\"3fa2fc40-ad5d-4c35-b6f2-0d1e6b566671\\", \\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Our Ninja Warrior Camp is designed to provide your child with entertaining and challenging activities to keep their minds and bodies sharp. Our mission is to develop better health through movement and we believe that young children learn best when they are challenged with new obstacles. Ninja Warrior Camp will provide the stimulation they need to keep them growing and developing into amazing human beings! To enroll your student in our Ninja Warrior Camp, call (816) 347-8008 today!</p>\\"}]", "numchild": 0, "pk": 14, "live": true, "path": "0001000200010005", "title": "Motus Camp", "expired": false, "content_type": 12, "search_description": "", "schedule": "[{\\"id\\": \\"a42f8d43-be81-4e3e-b3a6-404ebb98c01c\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"THURSDAY\\", \\"times\\": \\"10:00am-noon\\", \\"category\\": \\"Camp\\"}}, {\\"id\\": \\"b7fe0778-23fb-4610-9b2d-5d3977bece1e\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"WEDNESDAY\\", \\"times\\": \\"10:00am-noon\\", \\"category\\": \\"Camp\\"}}, {\\"id\\": \\"a8599d41-52bb-4e8f-ae6f-36f705ffa953\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"10:00am-noon\\", \\"category\\": \\"Camp\\"}}, {\\"id\\": \\"d4a9afa2-120b-4d0e-b9c4-9c2e79e69fdb\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"MONDAY\\", \\"times\\": \\"10am-noon\\", \\"category\\": \\"Camp\\"}}]", "owner": 1, "expire_at": null, "depth": 4, "draft_title": "Motus Camp", "intro": "The Motus Ninja Warrior Camp provides your child with entertaining and challenging activities to keep young minds and bodies sharp.", "first_published_at": "2018-09-13T13:16:22.836Z", "sub_title": null, "show_in_menus": false, "url_path": "/index/our-programs/motus-camp/