142	f	2018-09-18 15:39:48.721194+00	{"name": "TJ", "role": "Maestro", "live": true, "categories": [1, 2, 3], "depth": 4, "locked": false, "path": "0001000200020003", "pk": 21, "url_path": "/index/motus-crew/tj-el-maestro/", "expire_at": null, "desc": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"be664720-8b50-4891-9580-fec5db21632d\\", \\"value\\": \\"<p>After spending 20+ years in the gymnastics coaching at the highest level, I decided to expand my love on of the sport of gymnastics to Ninja Warrior. Ninja Warrior combines my passion for movement and fitness into one activity. I always have this dream of obstacle courses training to get fit.</p>\\"}]", "latest_revision_created_at": "2018-09-18T15:36:00.090Z", "owner": 1, "intro": "TJ is the founder of xtreme gymnastics and he made the bold decision to launch our new ninja club Motus Ninja Warrior.", "first_published_at": "2018-09-18T15:36:00.113Z", "live_revision": 141, "content_type": 18, "show_in_menus": false, "last_published_at": "2018-09-18T15:36:00.113Z", "seo_title": "", "draft_title": "TJ (el Maestro)", "search_description": "", "go_live_at": null, "slug": "tj-el-maestro", "numchild": 0, "title": "TJ (il Maestro)", "expired": false, "header_image": 25, "has_unpublished_changes": false}	\N	21	1
169	f	2018-09-19 18:13:08.434142+00	{"name": "Randi Owens", "role": "Ninja Instructor", "live": true, "categories": [2], "depth": 4, "locked": false, "path": "0001000200020004", "pk": 22, "url_path": "/index/motus-crew/randi-owens/", "expire_at": null, "desc": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"e00ca65a-3b32-449e-979a-69651398ae8a\\", \\"value\\": \\"<p></p><p><b>Favorite Obstacles:</b> The ring slider, unstable bridge, and the iconic warped wall!</p><p><b>Hobbies:</b> Climbing, Drawing, and Rock/Mineral Collecting</p><p><b>Passions:</b> Protecting and appreciating nature and wildlife, promoting positivity, kindness, growth, being knowledgeable in all that she does, and always making time for her friends and family.</p>\\"}]", "latest_revision_created_at": "2018-09-19T17:50:19.367Z", "owner": 2, "intro": "Randi has been with Motus since 2018.", "first_published_at": "2018-09-19T17:50:19.389Z", "live_revision": 166, "content_type": 18, "show_in_menus": false, "last_published_at": "2018-09-19T17:50:19.389Z", "seo_title": "", "draft_title": "Randi Owens", "search_description": "", "go_live_at": null, "slug": "randi-owens", "numchild": 0, "title": "Randi Owens", "expired": false, "header_image": 26, "has_unpublished_changes": false}	\N	22	2
