269	f	2019-03-06 19:47:53.316907+00	{"pk": 20, "path": "0001000200030004", "search_description": "Motus Ninja Warrior Grand Opening", "url_path": "/index/activities/grand-opening/", "live_revision": 268, "post_tags": [], "title": "Motus Ninja Competition", "last_published_at": "2019-03-06T18:37:25.531Z", "slug": "grand-opening", "has_unpublished_changes": false, "numchild": 0, "live": true, "intro": "DO YOU HAVE WHAT IT TAKES TO CONQUER MOTUS?", "owner": 1, "categories": [1, 2], "seo_title": "", "first_published_at": "2018-09-17T19:05:58.100Z", "header_image": 31, "date": "2018-09-15", "go_live_at": null, "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"6548ede5-5c3f-48e4-80ce-24ebe3f4abe4\\", \\"value\\": \\"<p><b>Date:</b> April 27th &amp; 28th</p><p><b>Kids:</b> 04/27/19</p><p><b>Adults:</b> 04/28/19</p><p><b>Competition System:</b> Point</p><p><b>Max Competitors:</b> 30 (For each age group)</p><p><b>Entry Fee:</b> Kids / Teens $50 Adults: $60</p><p><b>Adult Prizes:    1st</b> - $150<b>    2nd</b> -  $100    <b>3rd</b> -  $60</p><p><b>Kid Prizes:</b>    <b>1st</b> -  Atomik Banana Bomb set and open gym pass    <b>2nd</b> - Atomik Bomb set and open gym pass    <b>3rd</b> - Atomik Cannon Ball and open gym pass</p><p></p><p><b>KIDS</b></p><p>All competitors will run Stage 1 and Stage 2.</p><p>A combination of Points and Time will determine 1st, 2nd and 3rd place.</p><p><b>Stage 1 Group times</b></p><p>6-7 years check-in time/warm-up: 9AM-9:15AM</p><p>6-7 years course rules: 9:15AM-9:20AM</p><p>6-7 years run start: 9:20AM</p><p>8-10 years check-in time/warm-up: 12:00PM-12:15PM</p><p>8-10 years course rules: 12:15PM-12:20PM</p><p>8-10 years runs start: 12:20PM</p><p>11-13 years check-in time/warm-up: 3:00PM-3:15PM</p><p>11-13 years course rules: 3:15PM-3:20PM</p><p>11-13 years runs start: 3:20PM</p><p>14-17 years check-in time/warm-up: 6:00PM-6:15PM</p><p>14-17 years course rules: 6:15PM-6:20PM</p><p>14-17 years runs start: 6:20PM</p><p><b>Stage 2 Group times</b></p><p>6-7 years Course rules individually as Stage 1 is completed</p><p>6-7 years Runs start after rules</p><p>6-7 years Award 11:30PM</p><p>8-10 years Course rules individually as Stage 1 is completed</p><p>8-10 years Runs start after rules</p><p>8-10 years Award 2:30PM</p><p>11-13 years Course rules individually as Stage 1 is completed</p><p>11-13 years Runs start after rules</p><p>11-13 years Award 5:30PM</p><p>14-17 years Course rules individually as Stage 1 is completed</p><p>14-17 years Runs start after rules</p><p>14-17 years Award 8:30PM</p><p></p><p><b>ADULTS</b></p><p>All competitors will run Stage 1 and Stage 2.</p><p>A combination of Points and Time will determine 1st, 2nd and 3rd place.</p><p><b>Stage 1 times</b></p><p>Adults check-in time/warm-up: 2PM-2:15PM</p><p>Adults course rules: 2:20PM</p><p>Adults run start: 2:30PM</p><p><b>Stage 2 times</b></p><p>Course rules individually as Stage 1 is completed</p><p>Runs start after rules</p><p>Awards 5:00PM</p><p></p><p><b>Stage 1</b></p><p>Points Per Obstacle Completed: 1</p><p>Competitors will receive 1 Point for each obstacle they complete.</p><p>Completing the same obstacle twice will NOT result in more points.</p><p>If an obstacle is failed and there is time remaining on the clock, the competitor may attempt the obstacles again, from the beginning, as many times as needed to obtain a point.</p><p>If a competitor is in the middle of an obstacle and times expires, that obstacle will be considered failed.</p><p>Points will carry-over to Stage 2.</p><p><b>Stage 2</b></p><p>Points Per Obstacle Completed: 1</p><p>Competitors will receive 1 Point for each obstacle they complete.</p><p>Competitors will NOT receive multiple attempts on any obstacle.</p><p>Once an obstacle is failed, they must move on to the next obstacle.</p><p>Competitors may take a 15 second break/rest after completing or failing an obstacle.</p><p></p><p>Email or visit our website to reserve your spot today!</p><p>info@motusninjawarrior.com</p><p><a href=\\\\\\"https://app.iclasspro.com/parentportal/motus\\\\\\">https://app.iclasspro.com/parentportal/motus</a></p>\\"}]", "draft_title": "Motus Ninja Competition", "expired": false, "depth": 4, "show_in_menus": false, "locked": false, "latest_revision_created_at": "2019-03-06T18:37:25.492Z", "expire_at": null, "content_type": 7}	\N	20	2
