272	f	2019-03-15 20:51:41.445479+00	{"pk": 14, "path": "0001000200010005", "search_description": "", "url_path": "/index/our-programs/motus-camp/", "live_revision": 242, "title": "Motus Camp", "last_published_at": "2019-01-25T19:32:47.441Z", "slug": "motus-camp", "has_unpublished_changes": false, "numchild": 0, "live": true, "intro": "The Motus Ninja Warrior Camp provides your child with entertaining and challenging activities to keep young minds and bodies sharp.", "owner": 1, "seo_title": "", "first_published_at": "2018-09-13T13:16:22.836Z", "header_image": 16, "go_live_at": null, "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"3fa2fc40-ad5d-4c35-b6f2-0d1e6b566671\\", \\"value\\": \\"<p>Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Sports Camps are for you! At Motus we offer weekly summer camps for ages 5-12. Participants will be led by\\\\u00a0our knowledgable staff on obstacles, exercises and lots of fun.\\\\u00a0Thursday afternoon, participants will compete in a Speed Course Competition.\\\\u00a0Every ninja will be awarded a camp completion certificate on the last day of camp.\\\\u00a0<br/>Our camps run Monday through Thursday with an open gym pass for Friday.\\\\u00a0To enroll your student in our Ninja Warrior Camp, call (816) 347-8008 today!</p><p><b>Camp Weeks:</b><br/>June 3rd, 10th, 17th, 24th<br/>July 8th, 15th, 22nd, 29th<br/>August 5th</p><p><b>Camp Cost:</b></p><p>$75 for non-members</p><p>$70 for current members</p><p></p>\\"}]", "draft_title": "Motus Camp", "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"a42f8d43-be81-4e3e-b3a6-404ebb98c01c\\", \\"value\\": {\\"category\\": \\"Motus Camp\\", \\"day\\": \\"THURSDAY\\", \\"times\\": \\"10:00-12:00\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"b7fe0778-23fb-4610-9b2d-5d3977bece1e\\", \\"value\\": {\\"category\\": \\"Motus Camp\\", \\"day\\": \\"WEDNESDAY\\", \\"times\\": \\"10:00-12:00\\"}}, {\\"typ