160	f	2018-09-19 02:01:50.283524+00	{"name": "TJ", "role": "\\"Capo\\"", "live": true, "categories": [1, 2, 3], "depth": 4, "locked": false, "path": "0001000200020003", "pk": 21, "url_path": "/index/motus-crew/tj-el-maestro/", "expire_at": null, "desc": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"be664720-8b50-4891-9580-fec5db21632d\\", \\"value\\": \\"<p>After spending 20+ years in the gymnastics industry coaching at the highest level, he decided to expand his love on of the sport of gymnastics to Ninja Warrior. Ninja Warrior combines his passion for movement and fitness into one activity.</p>\\"}]", "latest_revision_created_at": "2018-09-19T02:01:47.287Z", "owner": 1, "intro": "TJ is the founder of xtreme gymnastics and he made the bold decision to launch our new ninja club Motus Ninja Warrior.", "first_published_at": "2018-09-18T15:36:00.113Z", "live_revision": 158, "content_type": 18, "show_in_menus": false, "last_published_at": "2018-09-19T01:57:14.962Z", "seo_title": "", "draft_title": "TJ", "search_description": "", "go_live_at": null, "slug": "tj-el-maestro", "numchild": 0, "title": "TJ", "expired": false, "header_image": 25, "has_unpublished_changes": true}	\N	21	2
73	f	2018-09-14 19:49:51.13473+00	{"go_live_at": null, "url_path": "/index/our-story/ground-zero/", "title": "Ground Zero", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"c2ecc7ac-790e-48e5-a842-b92ed630d7b7\\", \\"value\\": \\"<p><b>Motus</b></p><p>Noun</p><p>Origin: Latin</p><p>Definition: movement</p>\\"}, {\\"type\\": \\"image_block\\", \\"id\\": \\"32567427-eabe-472d-9635-3bad13b6210c\\", \\"value\\": {\\"attribution\\": \\"\\", \\"image\\": 21, \\"caption\\": \\"\\"}}]", "categories": [], "last_published_at": "2018-09-14T19:49:05.651Z", "search_description": "", "path": "0001000200030001", "intro": "We wanted to create a new outlet of fun for kids and adults.", "latest_revision_created_at": "2018-09-14T19:49:05.606Z", "content_type": 7, "owner": 1, "numchild": 0, "live": true, "seo_title": "", "first_published_at": "2018-09-13T08:13:13.135Z", "expire_at": null, "locked": false, "live_revision": 72, "draft_title": "Ground Zero", "expired": false, "show_in_menus": false, "date": "2018-08-08", "header_image": 17, "post_tags": [{"pk": null, "tag": 1, "content_object": 9}], "pk": 9, "slug": "ground-zero", "has_unpublished_changes": false, "depth": 4}	\N	9	2
101	f	2018-09-14 22:34:22.861606+00	{"has_unpublished_changes": false, "last_published_at": "2018-09-14T22:20:38.212Z", "body": "[{\\"id\\": \\"255fe4c9-87bf-4a19-a3b9-025b20284139\\", \\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Motus offers the most fun in Lee\\\\u2019s Summit with open gyms, parties, field trips, and team building experiences. Unlock your inner warrior on 240&#x27; of obstacle course, one of our 4 warped walls, the campus board, jumping spider, cliffhanger, or maybe even the wing nuts!</p><p></p><p><b>Daily Open Gym</b></p><p>Open gyms are perfect for burning off energy, testing your strength, conquering challenging obstacles, and having fun! You have access to our entire facility and can work at your own pace. This is not an instructor led class but feel free to ask our staff for guidance or to demonstrate an obstacle.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $15 per person</p><p></p><p><b>Friday Night Ninjas</b></p><p>Drop the kids off or stay and watch as they burn off some energy conquering the course. The high-energy obstacles will engage their bodies and minds. The course gives them the opportunity to challenge their friends, learn new skills, and improve their fitness level. Every Friday night we have a speed course challenge. The winner earns a FREE open gym pass!</p><p>Ages 5-14 $15 per person</p><p>7:00pm-9:00pm</p><p>Speed Course Challenge 8:00pm</p><p></p><p><b>Saturday Family Play</b></p><p>Looking for something fun for the family on Saturday nights? Come challenge them on the speed course, try new obstacles, or even learn new skills. Enjoy free reign of all our facility has to offer.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult)</p><p>5:00pm-7:00 pm $10 per person</p><p></p><p><b>Parties</b></p><p>Let us host your event! We offer parties for ages 4 and up for any occasion. The party host and 15 of their friends will discover their inner ninja as they challenge themselves on our many obstacles. Our party staff will take care of everything from set-up to clean-up. Parties include cake, paper goods, drinks, goody bags, and two party coaches! Enjoy an exclusive hour and 15 minutes of play and 30 minutes for cakes and gifts.</p><p>$299+ tax total for 1-15 children, $15 for each additional child. $100 minimum deposit at booking.</p><p>We offer parties every Saturday at 1:00pm and 3:00pm.</p><p></p><p><b>Field Trips/Team Building</b></p><p>Our field trips allow students, staff, team etc. to be active and engaged while using their muscles and brains to complete obstacles for their level. The obstacles and courses offer a unique and safe environment to build confidence and self esteem, while benefiting their health. Be a ninja for a couple hours.</p><p>Our team building will help you grow with your team as you work together to overcome obstacles and learn to conquer challenges. Our crew will bring you a challenge and provide you with tools. Our unique obstacles and environment give your team the opportunity to step out of their comfort zone, think outside the box, and feel the satisfaction of succeeding together.</p><p></p>\\"}]", "numchild": 0, "pk": 7, "live": true, "path": "0001000200010001", "title": "Motus Fun", "expired": false, "content_type": 12, "search_description": "", "schedule": "[{\\"id\\": \\"8e9b1dba-02eb-4ddd-bd12-27ff0992ad4f\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"FRIDAY\\", \\"times\\": \\"9:30am\\", \\"category\\": \\"-noon Open Gym\\"}}, {\\"id\\": \\"f0638b30-2f9d-4b96-a491-45c7e3a682d3\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"FRIDAY\\", \\"times\\": \\"1:00pm\\", \\"category\\": \\"-7:00pm Open Gym\\"}}]", "owner": 1, "expire_at": null, "depth": 4, "draft_title": "Motus Fun", "intro": "Motus offers the most fun in Lee\\u2019s Summit with open gyms, parties, field trips, and team building experiences.", "first_published_at": "2018-09-13T08:07:46.469Z", "sub_title": "For Kids & Adult