74	f	2018-09-14 20:07:52.453239+00	{"go_live_at": null, "url_path": "/index/motus-crew/", "title": "Motus Crew", "last_published_at": "2018-09-13T07:49:35.078Z", "search_description": "", "path": "000100020002", "intro": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"26437254-c718-4d5c-ac09-de4140a6183e\\", \\"value\\": \\"<p>A great place would certainly not be great without great people to run the show.</p>\\"}]", "latest_revision_created_at": "2018-09-13T07:49:35.065Z", "content_type": 17, "owner": 1, "numchild": 2, "live": true, "seo_title": "", "first_published_at": "2018-09-13T07:49:35.078Z", "expire_at": null, "locked": false, "live_revision": 3, "draft_title": "Motus Crew", "expired": false, "show_in_menus": false, "pk": 5, "slug": "motus-crew", "has_unpublished_changes": false, "depth": 3}	\N	5	2
234	f	2019-01-25 19:31:07.919164+00	{"go_live_at": null, "expire_at": null, "last_published_at": "2018-09-14T20:10:48.821Z", "show_in_menus": false, "slug": "our-programs", "latest_revision_created_at": "2018-09-14T20:11:41.897Z", "expired": false, "title": "Our Programs", "content_type": 11, "path": "000100020001", "live_revision": 76, "locked": false, "live": false, "intro": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"7d4779f6-efd7-41cc-ae39-0b8b3aa65dd1\\", \\"value\\": \\"<p>Our programs are geared towards movement, agility, strength, and attaining full mobility. We strive to help kids and adults lead an active and healthy lifestyle by teaching the importance of exercise in a fun, safe, and supportive environment.</p>\\"}]", "draft_title": "Our Programs", "url_path": "/index/our-programs/", "seo_title": "", "first_published_at": "2018-09-13T07:48:50.305Z", "has_unpublished_changes": true, "pk": 4, "search_description": "", "depth": 3, "numchild": 5, "owner": 1}	\N	4	2
40	f	2018-09-14 16:54:21.359095+00	{"go_live_at": null, "url_path": "/index/our-programs/motus-fun/", "title": "Motus Fun", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"255fe4c9-87bf-4a19-a3b9-025b20284139\\", \\"value\\": \\"<p>Motus offers the most fun in Lee\\\\u2019s Summit with open gyms, parties, field trips, and team building experiences. Unlock your inner warrior on 240&#x27; of obstacle course, one of our 4 warped walls, the campus board, jumping spider, cliffhanger, or maybe even the wing nuts!</p><p></p><p><b>Daily Open Gym</b></p><p>Open gyms are perfect for burning off energy, testing your strength, conquering challenging obstacles, and having fun! You have access to our entire facility and can work at your own pace. This is not an instructor led class but feel free to ask our staff for guidance or to demonstrate an obstacle.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $15 per person</p><p></p><p><b>Friday Night Ninjas</b></p><p>Drop the kids off or stay and watch as they burn off some energy conquering the course. The high-energy obstacles will engage their bodies and minds. The course gives them the opportunity to challenge their friends, learn new skills, and improve their fitness level. Every Friday night we have a speed course challenge. The winner earns a FREE open gym pass!</p><p>Ages 5-14 $15 per person -  7:00pm-9:00pm - Speed Course Challenge 8:00pm</p><p></p><p></p><p><b>Saturday Family Play</b></p><p>Looking for something fun for the family on Saturday nights? Come challenge them on the speed course, try new obstacles, or even learn new skills. Enjoy free reign of all our facility has to offer.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) - Saturday 5:00pm-7:00 pm $10 per person</p><p></p><p><b>Parties</b></p><p>Let us host your event! We offer parties for ages 4 and up for any occasion. The party host and 15 of their friends will discover their inner ninja as they challenge themselves on our many obstacles. Our party staff will take care of everything from set-up to clean-up. Parties include cake, paper goods, drinks, goody bags, and two party coaches! Enjoy an exclusive hour and 15 minutes of play and 30 minutes for cakes and gifts.</p><p>$299+ tax total for 1-15 children, $15 for each additional child. $100 minimum deposit at booking.</p><p>We offer parties every Saturday at 1:00pm and 3:00pm.</p><p></p><p><b>Field Trips/Team Building</b></p><p>Our field trips allow students, staff, team etc. to be active and engaged while using their muscles and brains to complete obstacles for their level. The obstacles and courses offer a unique and safe environment to build confidence and self esteem, while benefiting their health. Be a ninja for a couple hours.</p><p>Our team building will help you grow with your team as you work together to overcome obstacles and learn to conquer challenges. Our crew will bring you a challenge and provide you with tools. Our unique obstacles and environment give your team the opportunity to step out of their comfort zone, think outside the box, and feel the satisfaction of succeeding together.</p><p></p>\\"}]", "last_published_at": "2018-09-13T17:54:49.829Z", "search_description": "", "path": "0001000200010001", "intro": "Motus offers the most fun in Lee\\u2019s Summit with open gyms, parties, field trips, and team building experiences.", "latest_revision_created_at": "2018-09-13T17:54:49.802Z", "content_type": 12, "owner": 1, "numchild": 0, "live": true, "seo_title": "", "first_published_at": "2018-09-13T08:07:46.469Z", "expire_at": null, "locked": false, "live_revision": 26, "draft_title": "Motus Fun", "expired": false, "show_in_menus": false, "header_image": 12, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"f0638b30-2f9d-4b96-a491-45c7e3a682d3\\", \\"value\\": {\\"category\\": \\"until 7:00pm\\", \\"times\\": \\"1:00pm\\", \\"day\\": \\"FRIDAY\\"}}]", "pk": 7, "sub_title": "For Kids & Adults", "slug": "motus-fun", "has_unpublished_changes": false, "depth": 4}	\N	7	2
