lves on our many obstacles. Our party staff will take care of everything from set-up to clean-up. Parties include cake, paper goods, drinks, goody bags, and two party coaches! Enjoy an exclusive hour and 15 minutes of play and 30 minutes for cakes and gifts.</p><p>$299+ tax total for 1-15 children, $15 for each additional child. $100 minimum deposit at booking.</p><p>We offer parties every Saturday at 1:00pm and 3:00pm.</p><p></p><p><b>Field Trips/Team Building</b></p><p>Our field trips allow students, staff, team etc. to be active and engaged while using their muscles and brains to complete obstacles for their level. The obstacles and courses offer a unique and safe environment to build confidence and self esteem, while benefiting their health. Be a ninja for a couple hours.</p><p>Our team building will help you grow with your team as you work together to overcome obstacles and learn to conquer challenges. Our crew will bring you a challenge and provide you with tools. Our unique obstacles and environment give your team the opportunity to step out of their comfort zone, think outside the box, and feel the satisfaction of succeeding together.</p><p></p>\\"}]", "last_published_at": "2018-09-14T16:55:50.205Z", "search_description": "", "path": "0001000200010001", "intro": "Motus offers the most fun in Lee\\u2019s Summit with open gyms, parties, field trips, and team building experiences.", "latest_revision_created_at": "2018-09-14T16:55:50.180Z", "content_type": 12, "owner": 1, "numchild": 0, "live": true, "seo_title": "", "first_published_at": "2018-09-13T08:07:46.469Z", "expire_at": null, "locked": false, "live_revision": 42, "draft_title": "Motus Fun", "expired": false, "show_in_menus": false, "header_image": 12, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"f0638b30-2f9d-4b96-a491-45c7e3a682d3\\", \\"value\\": {\\"category\\": \\"Open Gym\\", \\"times\\": \\"1:00pm-7:00pm\\", \\"day\\": \\"FRIDAY\\"}}]", "pk": 7, "sub_title": "For Kids & Adults", "slug": "motus-fun", "has_unpublished_changes": false, "depth": 4}	\N	7	2
