77	f	2018-09-14 20:11:41.89748+00	{"go_live_at": null, "url_path": "/index/our-programs/", "title": "Our Programs", "last_published_at": "2018-09-14T20:10:48.821Z", "search_description": "", "path": "000100020001", "intro": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"7d4779f6-efd7-41cc-ae39-0b8b3aa65dd1\\", \\"value\\": \\"<p>Our programs are geared towards movement, agility, strength, and attaining full mobility. We strive to help kids and adults lead an active and healthy lifestyle by teaching the importance of exercise in a fun, safe, and supportive environment.</p>\\"}]", "latest_revision_created_at": "2018-09-14T20:10:48.799Z", "content_type": 11, "owner": 1, "numchild": 5, "live": true, "seo_title": "", "first_published_at": "2018-09-13T07:48:50.305Z", "expire_at": null, "locked": false, "live_revision": 76, "draft_title": "training", "expired": false, "show_in_menus": false, "pk": 4, "slug": "our-programs", "has_unpublished_changes": false, "depth": 3}	\N	4	2
29	f	2018-09-13 18:20:33.360804+00	{"show_in_menus": false, "go_live_at": null, "expire_at": null, "expired": false, "slug": "homeschool", "header_image": 15, "title": "Homeschool", "last_published_at": "2018-09-13T13:13:45.006Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"263bcbb8-cfd7-4536-9aa8-4fa7f8f5c138\\", \\"value\\": \\"<p>Homeschool Motus Kids offers a variety of Ninja Warrior classes for ninjas ages 4-17. Our obstacle courses will help kids build confidence by overcoming fears and challenges. All while having fun and staying active.</p><p></p><ul><li><b>Homeschool Ninjas</b>: We have an amazing homeschool program that offers class for ages 4 to 17. Your child will learn the skills they need to master balance, agility, strength and their overall fitness level - all while having a blast doing it! Every week, our instructors will put together fun new courses to keep things interesting and challenging. Your ninja will learn basic moves for safety, developmental progressions for skills, bodyweight exercises and plyo exercises. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</li></ul>\\"}]", "draft_title": "Homeschool", "seo_title": "", "search_description": "", "sub_title": "Weekly class", "depth": 4, "live": true, "path": "0001000200010004", "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"5ed2542c-dc3e-4a3b-a5d7-daf2f76f4291\\", \\"value\\": {\\"day\\": \\"WEDNESDAY\\", \\"times\\": \\"8:00am;10:00am;12:00pm;3:00pm\\", \\"category\\": \\"Ninja Kids\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"87fa6214-07f7-4ced-8e6f-2f6440a95d8b\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"8:00am;10:00am;12:00pm;3:00pm\\", \\"category\\": \\"Homeschool\\"}}]", "first_published_at": "2018-09-13T13:13:45.006Z", "intro": "Homeschool Motus Kids offers a variety of Ninja Warrior classes for ninjas ages 4-17.  Our obstacle courses will help kids build confidence by overcoming fears and challenges. All while having fun and staying active at Motus.", "latest_revision_created_at": "2018-09-13T13:13:44.985Z", "has_unpublished_changes": false, "numchild": 0, "url_path": "/index/our-programs/homeschool/", "pk": 13, "owner": 1, "live_revision": 18, "locked": false, "content_type": 12}	\N	13	1
172	f	2018-09-20 14:45:18.789219+00	{"name": "TJ", "role": "CEO", "live": true, "categories": [3], "depth": 4, "locked": false, "path": "0001000200020003", "pk": 21, "url_path": "/index/motus-crew/tj-el-maestro/", "expire_at": null, "desc": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"be664720-8b50-4891-9580-fec5db21632d\\", \\"value\\": \\"<p>As owner of Motus Ninja Warrior and Xtreme Gymnastics, TJ has invested over two decades to the athletic development of gymnastics; coaching at the elite level with the integrity of developing character through athletics. His combined passion for adventure and wellness has led to his innovative launch of Motus Ninja Warrior, where movement is the foundation of living better. He dreams on a grand scale with a competitive mindset in and out of the gym. He thrives on continuous improvement with an authentic fortitude to help others succeed. TJ is an alumnus of the University of Missouri Kansas City and has been instrumental in his community\\\\u2019s legislative changes that protect the sports industry.</p>\\"}]", "latest_revision_created_at": "2018-09-19T17:46:01.002Z", "owner": 1, "intro": "After owning Xtreme Gymnastics for 15+ years Tj decided launch Motus Ninja Warrior.", "first_published_at": "2018-09-18T15:36:00.113Z", "live_revision": 164, "content_type": 18, "show_in_menus": false, "last_published_at": "2018-09-19T17:46:01.036Z", "seo_title": "", "draft_title": "TJ Rehak", "search_description": "", "go_live_at": null, "slug": "tj-el-maestro", "numchild": 0, "title": "TJ Rehak", "expired": false, "header_image": 25, "has_unpublished_changes": false}	\N	21	2
