125	f	2018-09-15 09:04:51.811203+00	{"depth": 4, "show_in_menus": false, "path": "0001000200010003", "body": "[{\\"value\\": \\"<p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying. Motus Fit focuses on increasing movement, balance, and coordination. We strive to get you to your full mobility using your body weight, resistance bands, med balls, jump ropes, and more. Life is about the go and the experiences along the way.</p><p>LIVE MORE!</p><p></p><p><b>Motus Fit</b></p><p>Motus Fit is a high intensity interval workout. Every session combines a variety of movements from many disciplines to create an engaging and challenging workout. Our instructors ensure guidance, scaling, and customization to accommodate any skill level. The unique environment and equipment make your workout feel more like playing around. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p></p><p></p><p><b>Motus Fit Kids (8-17)</b></p><p>Kids just want to have fun and it is possible to show them how to enjoy exercise while improving their health and fitness. Our high-energy instructors will motivate your child through a workout that combines movements from calisthenics, ninja warrior, endurance training, and more. Obstacles will be used to build balance, coordination, confidence, and strength. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p></p>\\", \\"type\\": \\"paragraph_block\\", \\"id\\": \\"37cae8c5-745c-404a-81e3-d2ad1c99dcf7\\"}]", "locked": false, "title": "Motus Fit", "url_path": "/index/our-programs/motus-fit/", "sub_title": "For Kids & Adults", "draft_title": "Motus Fit", "owner": 1, "seo_title": "", "content_type": 12, "expire_at": null, "intro": "Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benche