257	f	2019-02-25 17:56:43.899816+00	{"go_live_at": null, "expire_at": null, "last_published_at": "2019-01-25T19:32:36.536Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"a868084c-9e3f-4516-84c7-20321eb4980a\\", \\"value\\": \\"<p>Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!</p><p></p><ul><li><b>Mini Ninjas(Ages 4-5)</b></li></ul><p>Bring your four and five-year-olds to burn energy while gaining balance and coordination. Our Mini Ninja classes give your kiddos a unique opportunity to take on Ninja Warrior obstacles their size. They will feel like an American Ninja Warrior while racing against time on our speed course. Your little warrior will learn to control their body like a ninja in a safe, fun, and structured environment.</p><ul><li><b>Intro to Ninja: Parent and Child (ages 4-15)</b></li></ul><p>Our Intro class allows parents and children to move at their own pace while learning ninja obstacles and techniques. This is an instructor led class, but parents and children will help teach each other by working through the obstacles together with the guidance of the instructor. </p><p></p><p><b>Ninja Warriors (Ages 6-15)</b></p><p>Our classes are designed to help kids burn energy while gaining balance, strength and coordination. The course offers a unique opportunity to build confidence while overcoming challenges. They will feel like an American Ninja Warrior while racing against time on our speed course. Our ninjas will learn to conquer the course through obstacle progression and skill development. Classes will also focus on increasing strength and agility. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</p><p></p><ul><li><b>Adult Ninja Warrior (Ages 16+)</b></li></ul><p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying.</p><p>Our Ninja Instructors will guide you through moves for safety, developmental progressions for obstacles, and conditioning to take you to the next level. As you gain better mobility through our program you will enjoy more adventures in life. Whether you want to compete, stay in shape, or just have fun, we are there to make sure you succeed!</p>\\"}]", "show_in_menus": false, "header_image": 13, "slug": "ninja-warriors", "latest_revision_created_at": "2019-01-25T19:32:36.511Z", "expired": false, "title": "Ninja Warriors", "content_type": 12, "path": "0001000200010002", "live_revision": 240, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"f31d7110-7502-4c09-b3f3-48af9e32b76f\\", \\"value\\": {\\"times\\": \\"10:00-11:00\\", \\"day\\": \\"SATURDAY\\", \\"category\\": \\"Intro to Ninja\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"485a583a-eccc-45d2-a44e-ff74b27c2cad\\", \\"value\\": {\\"times\\": \\"10:00-11:00\\", \\"day\\": \\"SATURDAY\\", \\"category\\": \\"Mini Ninja\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"031874fc-9e7e-4804-9685-3146eff0a843\\", \\"value\\": {\\"times\\": \\"9:00-10:00;11:00-12:00\\", \\"day\\": \\"SATURDAY\\", \\"category\\": \\"Ninja Warrior 9-15\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"caf3d9c9-2b11-4a1d-ab8f-c60afce3888f\\", \\"value\\": {\\"times\\": \\"9:00-10:00;11:00-12:00\\", \\"day\\": \\"SATURDAY\\", \\"category\\": \\"Ninja Warrior 6-8\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"30b81389-39fb-4689-909f-ef19ff51b546\\", \\"value\\": {\\"times\\": \\"18:00-19:00;19:00-20:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"Adult Ninja Warrior\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"a0a31cc1-a665-4e27-a748-9ec1d27a3761\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"Ninja Warrior (6-15)\\"}}, {\\"typ