53	f	2018-09-14 17:52:50.285814+00	{"go_live_at": null, "url_path": "/index/our-programs/motus-fit/", "title": "Motus Fit", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"37cae8c5-745c-404a-81e3-d2ad1c99dcf7\\", \\"value\\": \\"<p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying. Motus Fit focuses on increasing movement, balance, and coordination. We strive to get you to your full mobility using your body weight, resistance bands, med balls, jump ropes, and more. Life is about the go and the experiences along the way.</p><p>LIVE MORE!</p><p></p><p><b>Motus Fit</b></p><p>Motus Fit is a high intensity interval workout. Every session combines a variety of movements from many disciplines to create an engaging and challenging workout. Our high-energy instructors ensure guidance, scaling, and customization to accommodate any skill level. The unique environment and equipment make your workout feel more like playing around. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p>LIVE MORE!</p><p></p><p><b>Motus Fit Kids (8-17)</b></p><p>Kids just want to have fun and it is possible to show them how to enjoy exercise while improving their health and fitness. Our high-energy instructors will motivate your child through a workout that combines movements from calisthenics, ninja warrior, endurance training, and more. Obstacles will be used to build balance, coordination, confidence, and strength. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p>LOVE MORE!</p>\\"}]", "last_published_at": "2018-09-14T17:04:34.669Z", "search_description": "", "path": "0001000200010003", "intro": "Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying.", "latest_revision_created_at": "2018-09-14T17:04:34.639Z", "content_type": 12, "owner": 1, "numchild": 0, "live": true, "seo_title": "", "first_published_at": "2018-09-13T08:40:38.305Z", "expire_at": null, "locked": false, "live_revision": 51, "draft_title": "Motus Fit", "expired": false, "show_in_menus": false, "header_image": 14, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"562993ac-1d6d-4043-91d4-85cf8ebabcf3\\", \\"value\\": {\\"category\\": \\"Homeschool\\", \\"times\\": \\"9:00am;11:00am;3:00pm\\", \\"day\\": \\"TUESDAY\\"}}]", "pk": 12, "sub_title": "For Kids & Adults", "slug": "motus-fit", "has_unpublished_changes": false, "depth": 4}	\N	12	2
128	f	2018-09-15 12:01:51.166043+00	{"slug": "ground-zero", "url_path": "/index/activities/ground-zero/", "numchild": 0, "date": "2018-08-08", "body": "[{\\"value\\": \\"<p><b>Motus</b></p><p>Noun</p><p>Origin: Latin</p><p>Definition: movement</p>\\", \\"id\\": \\"c2ecc7ac-790e-48e5-a842-b92ed630d7b7\\", \\"type\\": \\"paragraph_block\\"}, {\\"value\\": {\\"image\\": 21, \\"attribution\\": \\"\\", \\"caption\\": \\"\\"}, \\"id\\": \\"32567427-eabe-472d-9635-3bad13b6210c\\", \\"type\\": \\"image_block\\"}, {\\"value\\": \\"<p>It took us a lot of time and effort to build this place.. hopefully you will like it as much as we do!</p><p>You might have been around before the transformation of the gym to welcome Motus Ninja Warrior, but if not you can watch this video with the building of Motus Ninja Warrior.</p>\\", \\"id\\": \\"eb82f1ae-ed90-45e4-9120-7cd3cbc72613\\", \\"type\\": \\"paragraph_block\\"}, {\\"value\\": \\"https://youtu.be/6WdGP6tbG1c\\", \\"id\\": \\"038a8001-a508-4b01-b382-40cda04eebad\\", \\"type\\": \\"embed_block\\"}]", "locked": false, "search_description": "", "owner": 1, "depth": 4, "header_image": 17, "has_unpublished_changes": false, "categories": [3], "post_tags": [{"pk": 14, "tag": 1, "content_object": 9}], "path": "0001000200030001", "live": true, "title": "Ground Zero", "first_published_at": "2018-09-13T08:13:13.135Z", "show_in_menus": false, "expire_at": null, "pk": 9, "draft_title": "Ground Zero", "live_revision": 127, "expired": false, "latest_revision_created_at": "2018-09-15T09:34:53.453Z", "content_type": 7, "seo_title": "", "intro": "We wanted to create a new outlet of fun for kids and adults.", "last_published_at": "2018-09-15T09:34:53.484Z", "go_live_at": null}	\N	9	2
273	f	2019-03-15 21:14:39.494726+00	{"pk": 20, "path": "0001000200030004", "search_description": "Motus Ninja Warrior Grand Opening", "url_path": "/index/activities/grand-opening/", "live_revision": 271, "post_tags": [], "title": "Motus Ninja Competition", "last_published_at": "2019-03-12T16:56:45.997Z", "slug": "grand-opening", "has_unpublished_changes": false, "numchild": 0, "live": true, "intro": "DO YOU HAVE WHAT IT TAKES TO CONQUER MOTUS?", "owner": 1, "categories": [1, 2], "seo_title": "", "first_published_at": "2018-09-17T19:05:58.100Z", "header_image": 31, "date": "2018-09-15", "go_live_at": null, "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"6548ede5-5c3f-48e4-80ce-24ebe3f4abe4\\", \\"value\\": \\"<p><b>Date:</b> April 27th &amp; 28th</p><p><b>Kids:</b> 04/27/19</p><p><b>Adults:</b> 04/28/19</p><p><b>Competition System:</b> Point</p><p><b>Max Competitors:</b> 30 (For each age group)</p><p><b>Entry Fee:</b> Kids / Teens $50 Adults: $60</p><p><b>Sign-up Deadline:</b> 4/14/19</p><p><b>Adult Prizes: 1st</b> - $150 and medal<b> 2nd</b> - $100 and medal <b>3rd</b> - $60 and medal</p><p><b>Kid Prizes:</b> <b>1st</b> - Medal and open gym pass <b>2nd</b> - Medal <b>3rd</b> - Medal</p><p></p><p><b>KIDS</b></p><p>All competitors will run Stage 1 and Stage 2.</p><p>A combination of Points and Time will determine 1st, 2nd and 3rd place.</p><p><b>Stage 1 Group times</b></p><p>6-7 years check-in time/warm-up: 9AM-9:15AM</p><p>6-7 years course rules: 9:15AM-9:20AM</p><p>6-7 years run start: 9:20AM</p><p>8-10 years check-in time/warm-up: 12:00PM-12:15PM</p><p>8-10 years course rules: 12:15PM-12:20PM</p><p>8-10 years runs start: 12:20PM</p><p>11-13 years check-in time/warm-up: 3:00PM-3:15PM</p><p>11-13 years course rules: 3:15PM-3:20PM</p><p>11-13 years runs start: 3:20PM</p><p>14-17 years check-in time/warm-up: 6:00PM-6:15PM</p><p>14-17 years course rules: 6:15PM-6:20PM</p><p>14-17 years runs start: 6:20PM</p><p><b>Stage 2 Group times</b></p><p>6-7 years Course rules individually as Stage 1 is completed</p><p>6-7 years Runs start after rules</p><p>6-7 years Award 11:30PM</p><p>8-10 years Course rules individually as Stage 1 is completed</p><p>8-10 years Runs start after rules</p><p>8-10 years Award 2:30PM</p><p>11-13 years Course rules individually as Stage 1 is completed</p><p>11-13 years Runs start after rules</p><p>11-13 years Award 5:30PM</p><p>14-17 years Course rules individually as Stage 1 is completed</p><p>14-17 years Runs start after rules</p><p>14-17 years Award 8:30PM</p><p></p><p><b>ADULTS</b></p><p>All competitors will run Stage 1 and Stage 2.</p><p>A combination of Points and Time will determine 1st, 2nd and 3rd place.</p><p><b>Stage 1 times</b></p><p>Adults check-in time/warm-up: 2PM-2:15PM</p><p>Adults course rules: 2:20PM</p><p>Adults run start: 2:30PM</p><p><b>Stage 2 times</b></p><p>Course rules individually as Stage 1 is completed</p><p>Runs start after rules</p><p>Awards 5:00PM</p><p></p><p><b>Stage 1</b></p><p>Points Per Obstacle Completed: 1</p><p>Competitors will receive 1 Point for each obstacle they complete.</p><p>Completing the same obstacle twice will NOT result in more points.</p><p>If an obstacle is failed and there is time remaining on the clock, the competitor may attempt the obstacles again, from the beginning, as many times as needed to obtain a point.</p><p>If a competitor is in the middle of an obstacle and times expires, that obstacle will be considered failed.</p><p>Points will carry-over to Stage 2.</p><p><b>Stage 2</b></p><p>Points Per Obstacle Completed: 1</p><p>Competitors will receive 1 Point for each obstacle they complete.</p><p>Competitors will NOT receive multiple attempts on any obstacle.</p><p>Once an obstacle is failed, they must move on to the next obstacle.</p><p>Competitors may take a 15 second break/rest after completing or failing an obstacle.</p><p></p><p>Email or visit our website to reserve your spot today!</p><p>info@motusninjawarrior.com</p><p><a href=\\\\\\"https://app.iclasspro.com/parentportal/motus\\\\\\">https://app.iclasspro.com/parentportal/motus</a></p>\\"}]", "draft_title": "Motus Ninja Competition", "expired": false, "depth": 4, "show_in_menus": false, "locked": false, "latest_revision_created_at": "2019-03-12T16:56:45.958Z", "expire_at": null, "content_type": 7}	\N	20	2
