187	f	2018-10-10 18:17:08.336309+00	{"expired": false, "expire_at": "2018-12-21T11:46:00Z", "latest_revision_created_at": "2018-10-08T16:48:22.820Z", "date": "2018-10-08", "header_image": 30, "live_revision": null, "last_published_at": null, "owner": 2, "content_type": 7, "live": false, "intro": "Movement is the foundation to an active lifestyle.", "has_unpublished_changes": true, "post_tags": [], "body": "[{\\"id\\": \\"ef5552ed-05d8-4ec0-92ad-8988d90b19b2\\", \\"value\\": \\"<p>Functional fitness exercises are designed to train and develop your muscles to make it easier and safer to perform everyday activities, such as carrying groceries or playing a game of basketball with your kids.</p><p>LIVE MORE!</p><p>Details</p><ul><li>8-week challenge</li><li>Begins October 29th \\\\u2026 Ends December 22nd</li><li>Must commit to 2 days a week<ul><li>Drop-in rate for extra days = $10</li></ul></li><li>Cost $159: includes 2 complimentary test days (1st week &amp; last week)</li><li>We encourage you to have Monday or Thursday as one of your workout days. Jose&#x27; is the trainer for these night classes and is well seasoned in many varieties of fitness.</li></ul><p>Grand Prize</p><p>1 Free month of unlimited Motus Fit sessions and a Motus shirt</p>\\", \\"type\\": \\"paragraph_block\\"}]", "seo_title": "", "show_in_menus": false, "first_published_at": null, "slug": "motus-fit-challenge", "search_description": "", "title": "Motus Fit Challenge", "numchild": 0, "url_path": "/index/activities/motus-fit-challenge/", "pk": 27, "depth": 4, "go_live_at": "2018-10-08T11:46:00Z", "draft_title": "Motus Fit Challenge", "locked": false, "categories": [1], "path": "0001000200030005"}	\N	27	2
238	f	2019-01-25 19:31:35.407272+00	{"go_live_at": null, "expire_at": null, "last_published_at": "2018-09-14T20:08:52.885Z", "show_in_menus": false, "slug": "motus-crew", "latest_revision_created_at": "2018-09-14T20:37:09.907Z", "expired": false, "title": "Motus Crew", "content_type": 17, "path": "000100020002", "live_revision": 75, "locked": false, "live": false, "intro": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"26437254-c718-4d5c-ac09-de4140a6183e\\", \\"value\\": \\"<p>A great place would certainly not be great without great people to run the show.</p>\\"}]", "draft_title": "Motus Crew", "url_path": "/index/motus-crew/", "seo_title": "Crew", "first_published_at": "2018-09-13T07:49:35.078Z", "has_unpublished_changes": true, "pk": 5, "search_description": "", "depth": 3, "numchild": 5, "owner": 1}	\N	5	2
116	f	2018-09-15 08:38:26.478635+00	{"has_unpublished_changes": false, "last_published_at": "2018-09-14T22:39:03.651Z", "body": "[{\\"id\\": \\"255fe4c9-87bf-4a19-a3b9-025b20284139\\", \\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Motus offers the most fun in Lee\\\\u2019s Summit with open gyms, parties, field trips, and team building experiences. Unlock your inner warrior on 240&#x27; of obstacle course, one of our 4 warped walls, the campus board, jumping spider, cliffhanger, or maybe even the wing nuts!</p><p></p><p><b>Daily Open Gym</b></p><p>Open gyms are perfect for burning off energy, testing your strength, conquering challenging obstacles, and having fun! You have access to our entire facility and can work at your own pace. This is not an instructor led class but feel free to ask our staff for guidance or to demonstrate an obstacle.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $15 per person</p><p></p><p><b>Friday Night Ninjas</b></p><p>Drop the kids off or stay and watch as they burn off some energy conquering the course. The high-energy obstacles will engage their bodies and minds. The course gives them the opportunity to challenge their friends, learn new skills, and improve their fitness level. Every Friday night we have a speed course challenge. The winner earns a FREE open gym pass!</p><p>Ages 5-14 $15 per person</p><p>7:00pm-9:00pm</p><p>Speed Course Challenge 8:00pm</p><p></p><p><b>Saturday Family Play</b></p><p>Looking for something fun for the family on Saturday nights? Come challenge them on the speed course, try new obstacles, or even learn new skills. Enjoy free reign of all our facility has to offer.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult)</p><p>5:00pm-7:00 pm $10 per person</p><p></p><p><b>Parties</b></p><p>Let us host your event! We offer parties for ages 4 and up for any occasion. The party host and 15 of their friends will discover their inner ninja as they challenge themselves on our many obstacles. Our party staff will take care of everything from set-up to clean-up. Parties include cake, paper goods, drinks, goody bags, and two party coaches! Enjoy an exclusive hour and 15 minutes of play and 30 minutes for cakes and gifts.</p><p>$299+ tax total for 1-15 children, $15 for each additional child. $100 minimum deposit at booking.</p><p>We offer parties every Saturday at 1:00pm and 3:00pm.</p><p></p><p><b>Field Trips/Team Building</b></p><p>Our field trips allow students, staff, team etc. to be active and engaged while using their muscles and brains to complete obstacles for their level. The obstacles and courses offer a unique and safe environment to build confidence and self esteem, while benefiting their health. Be a ninja for a couple hours.</p><p>Our team building will help you grow with your team as you work together to overcome obstacles and learn to conquer challenges. Our crew will bring you a challenge and provide you with tools. Our unique obstacles and environment give your team the opportunity to step out of their comfort zone, think outside the box, and feel the satisfaction of succeeding together.</p><p></p>\\"}]", "numchild": 0, "pk": 7, "live": true, "path": "0001000200010001", "title": "Motus Fun", "expired": false, "content_type": 12, "search_description": "", "schedule": "[{\\"id\\": \\"700db7c3-26bc-45c7-a6da-49a29d47c123\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"THURSDAY\\", \\"times\\": \\"9:30-12:00;13:00-17:00\\", \\"category\\": \\"Open Gym\\"}}, {\\"id\\": \\"70c660c2-d6bf-45d7-a472-3d475956b48d\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"WEDNESDAY\\", \\"times\\": \\"9:30-12:00;13:00-19:00\\", \\"category\\": \\"Open Gym\\"}}, {\\"id\\": \\"a161cfcd-1cb5-4999-9f3b-e2d4ad81aa31\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"9:30-12:00;13:00-17:00\\", \\"category\\": \\"Open Gym\\"}}, {\\"id\\": \\"6af1d2a1-6f5e-4205-b91c-7fc3a444e9f2\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"MONDAY\\", \\"times\\": \\"9:30-12:00;13:00-17:00\\", \\"category\\": \\"Open Gym\\"}}, {\\"id\\": \\"b5c2141e-8a54-4f20-a275-5eba25a28c68\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"SATURDAY\\", \\"times\\": \\"17:00:19:00\\", \\"category\\": \\"Open Gym\\"}}, {\\"id\\": \\"8e9b1dba-02eb-4ddd-bd12-27ff0992ad4f\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"FRIDAY\\", \\"times\\": \\"9:30-12:00;13:00-21:00\\", \\"category\\": \\"Open Gym\\"}}]", "owner": 1, "expire_at": null, "depth": 4, "draft_title": "Motus Fun", "intro": "Motus offers the most fun in Lee\\u2019s Summit with open gyms, parties, field trips, and team building experiences.", "first_published_at": "2018-09-13T08:07:46.469Z", "sub_title": "For Kids & Adults", "show_in_menus": false, "url_path": "/index/our-programs/motus-fun/", "locked": false, "live_revision": 104, "latest_revision_created_at": "2018-09-14T22:39:03.615Z", "slug": "motus-fun", "seo_title": "", "go_live_at": null, "header_image": 12}	\N	7	1
179	f	2018-10-04 18:47:13.38464+00	{"expired": false, "date": "2018-09-15", "categories": [1], "slug": "grand-opening", "draft_title": "Grand Opening", "live": true, "first_published_at": "2018-09-17T19:05:58.100Z", "expire_at": null, "has_unpublished_changes": false, "path": "0001000200030004", "depth": 4, "search_description": "Motus Ninja Warrior Grand Opening", "locked": false, "seo_title": "", "last_published_at": "2018-09-18T19:31:31.535Z", "owner": 1, "go_live_at": null, "url_path": "/index/activities/grand-opening/", "numchild": 0, "content_type": 7, "post_tags": [], "live_revision": 152, "body": "[{\\"id\\": \\"6548ede5-5c3f-48e4-80ce-24ebe3f4abe4\\", \\"value\\": \\"<p>Enjoy this experience for FREE with your family and friends. Come explore our gym and test your ninja strength.</p><p>\\\\ud83d\\\\udca5Special Offers\\\\ud83d\\\\udca5</p><ul><li>Enroll today and we will waive our $40 Family Fee.</li><li>Enroll today and pay NO tuition for the month of September!</li></ul><p></p><p>Thank you for coming to our Grand Opening! </p>\\", \\"type\\": \\"paragraph_block\\"}, {\\"id\\": \\"fd4ed3cc-3b0e-4254-8b11-d52b3edbf82f\\", \\"value\\": \\"https://www.facebook.com/motusninjawarrior/videos/331901390888030/\\", \\"type\\": \\"embed_block\\"}]", "show_in_menus": false, "header_image": 24, "latest_revision_created_at": "2018-09-18T19:31:31.510Z", "intro": "We are excited to have you come experience what Motus has to offer!", "pk": 20, "title": "Grand Opening"}	\N	20	2
