147	f	2018-09-18 15:41:26.209271+00	{"name": "TJ", "role": "Il Maestro", "live": true, "categories": [1, 2, 3], "depth": 4, "locked": false, "path": "0001000200020003", "pk": 21, "url_path": "/index/motus-crew/tj-el-maestro/", "expire_at": null, "desc": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"be664720-8b50-4891-9580-fec5db21632d\\", \\"value\\": \\"<p>After spending 20+ years in the gymnastics coaching at the highest level, I decided to expand my love on of the sport of gymnastics to Ninja Warrior. Ninja Warrior combines my passion for movement and fitness into one activity. I always have this dream of obstacle courses training to get fit.</p>\\"}]", "latest_revision_created_at": "2018-09-18T15:41:20.144Z", "owner": 1, "intro": "TJ is the founder of xtreme gymnastics and he made the bold decision to launch our new ninja club Motus Ninja Warrior.", "first_published_at": "2018-09-18T15:36:00.113Z", "live_revision": 145, "content_type": 18, "show_in_menus": false, "last_published_at": "2018-09-18T15:40:31.521Z", "seo_title": "", "draft_title": "TJ (il Maestro)", "search_description": "", "go_live_at": null, "slug": "tj-el-maestro", "numchild": 0, "title": "TJ (il Maestro)", "expired": false, "header_image": 25, "has_unpublished_changes": true}	\N	21	1
178	f	2018-10-04 18:44:07.577713+00	{"expired": false, "date": "2018-10-04", "categories": [1], "slug": "motus-fit-challenge", "draft_title": "Motus Fit Challenge", "live": false, "first_published_at": null, "expire_at": null, "has_unpublished_changes": false, "path": "0001000200030005", "depth": 4, "search_description": "", "locked": false, "seo_title": "", "last_published_at": null, "owner": 2, "go_live_at": null, "url_path": "/index/activities/motus-fit-challenge/", "numchild": 0, "content_type": 7, "post_tags": [], "live_revision": null, "body": "[{\\"id\\": \\"ef5552ed-05d8-4ec0-92ad-8988d90b19b2\\", \\"value\\": \\"<p>bnmn </p>\\", \\"type\\": \\"paragraph_block\\"}]", "show_in_menus": false, "header_image": 30, "latest_revision_created_at": null, "intro": "bkjbjkvbhkj", "pk": 27, "title": "Motus Fit Challenge"}	\N	27	2
258	f	2019-02-25 17:57:24.824135+00	{"go_live_at": null, "expire_at": null, "last_published_at": "2019-02-25T17:56:43.932Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"a868084c-9e3f-4516-84c7-20321eb4980a\\", \\"value\\": \\"<p>Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!</p><p></p><ul><li><b>Mini Ninjas(Ages 4-5)</b></li></ul><p>Bring your four and five-year-olds to burn energy while gaining balance and coordination. Our Mini Ninja classes give your kiddos a unique opportunity to take on Ninja Warrior obstacles their size. They will feel like an American Ninja Warrior while racing against time on our speed course. Your little warrior will learn to control their body like a ninja in a safe, fun, and structured environment.</p><ul><li><b>Intro to Ninja: Parent and Child (ages 4-15)</b></li></ul><p>Our Intro class allows parents and children to move at their own pace while learning ninja obstacles and techniques. This is an instructor led class, but parents and children will help teach each other by working through the obstacles together with the guidance of the instructor.</p><p></p><p><b>Ninja Warriors (Ages 6-15)</b></p><p>Our classes are designed to help kids burn energy while gaining balance, strength and coordination. The course offers a unique opportunity to build confidence while overcoming challenges. They will feel like an American Ninja Warrior while racing against time on our speed course. Our ninjas will learn to conquer the course through obstacle progression and skill development. Classes will also focus on increasing strength and agility. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</p><p></p><ul><li><b>Adult Ninja Warrior (Ages 16+)</b></li></ul><p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying.</p><p>Our Ninja Instructors will guide you through moves for safety, developmental progressions for obstacles, and conditioning to take you to the next level. As you gain better mobility through our program you will enjoy more adventures in life. Whether you want to compete, stay in shape, or just have fun, we are there to make sure you succeed!</p>\\"}]", "show_in_menus": false, "header_image": 13, "slug": "ninja-warriors", "latest_revision_created_at": "2019-02-25T17:56:43.899Z", "expired": false, "title": "Ninja Warriors", "content_type": 12, "path": "0001000200010002", "live_revision": 257, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"f31d7110-7502-4c09-b3f3-48af9e32b76f\\", \\"value\\": {\\"times\\": \\"10:00-11:00\\", \\"day\\": \\"SATURDAY\\", \\"category\\": \\"Intro to Ninja\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"485a583a-eccc-45d2-a44e-ff74b27c2cad\\", \\"value\\": {\\"times\\": \\"10:00-11:00\\", \\"day\\": \\"SATURDAY\\", \\"category\\": \\"Mini Ninja\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"031874fc-9e7e-4804-9685-3146eff0a843\\", \\"value\\": {\\"times\\": \\"9:00-10:00;11:00-12:00\\", \\"day\\": \\"SATURDAY\\", \\"category\\": \\"Ninja Warrior 9-15\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"caf3d9c9-2b11-4a1d-ab8f-c60afce3888f\\", \\"value\\": {\\"times\\": \\"9:00-10:00;11:00-12:00\\", \\"day\\": \\"SATURDAY\\", \\"category\\": \\"Ninja Warrior 6-8\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"30b81389-39fb-4689-909f-ef19ff51b546\\", \\"value\\": {\\"times\\": \\"18:00-19:00;19:00-20:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"Adult Ninja Warrior\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"a0a31cc1-a665-4e27-a748-9ec1d27a3761\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"Ninja Warrior (6-15)\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"d1a80711-86fe-4b06-88dd-f7230d72125a\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"Mini Ninja\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"4ec28e1a-56c5-45c5-800c-f035c9493489\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"WEDNESDAY\\", \\"category\\": \\"Ninja Warrior (6-15)\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"5cd6d8d7-686b-4d35-88b1-91ea159a3b0e\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00\\", \\"day\\": \\"WEDNESDAY\\", \\"category\\": \\"Mini Ninja\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"08149a71-437c-47a4-8804-e9ea466b6b0c\\", \\"value\\": {\\"times\\": \\"18:00-19:00;19:00-20:00\\", \\"day\\": \\"TUESDAY\\", \\"category\\": \\"Adult Ninja Warrior\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"35f48c2f-ee84-4dbe-af4f-bca3a3295b32\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"TUESDAY\\", \\"category\\": \\"Ninja Warrior (6-15)\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"eccb9fd4-212b-4d46-afd4-92606f6f6a7b\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"TUESDAY\\", \\"category\\": \\"Mini Ninja\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"746a3c08-9a3e-4ca8-83f9-0498b0399805\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"MONDAY\\", \\"category\\": \\"Ninja Warrior (6-15)\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"7ab79e77-7ead-44dd-a20f-8cf52ed2198c\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00\\", \\"day\\": \\"MONDAY\\", \\"category\\": \\"Mini Ninja\\"}}]", "locked": false, "live": true, "sub_title": "For Kids & Adults", "draft_title": "Ninja Warriors", "url_path": "/index/our-programs/ninja-warriors/", "seo_title": "", "first_published_at": "2018-09-13T08:37:20.434Z", "has_unpublished_changes": false, "pk": 11, "search_description"