15	f	2018-09-13 08:31:28.862481+00	{"pk": 3, "path": "00010002", "depth": 2, "numchild": 4, "title": "Motus Web Site", "draft_title": "Motus Web Site", "slug": "index", "content_type": 13, "live": true, "has_unpublished_changes": false, "url_path": "/index/", "owner": 1, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": "2018-09-13T07:51:15.709Z", "last_published_at": "2018-09-13T08:18:19.371Z", "latest_revision_created_at": "2018-09-13T08:18:19.348Z", "live_revision": 13, "image": 1, "hero_text": "Unlock Your Inner Warrior!", "hero_sub_text": "At KC\\u2019s Largest Ninja Facility", "hero_cta": "FREE trial!", "hero_cta_link": 10, "body": "<p>Motus is the largest ninja warrior facility in the KC Metro area housing over 240\\u2019 of obstacle course. We are designed to give the whole family a unique ninja and fitness experience. Here at Motus, we are devoted to keeping families active through movement. We are committed to keeping our courses challenging by adding new obstacles monthly.</p>", "promo_image": null, "promo_title": null, "promo_text": "<p></p>", "featured_section_1_title": "Our Programs", "featured_section_1": 4, "featured_section_2_title": "Our Story", "featured_section_2": 6, "featured_section_3_title": "Our Team", "featured_section_3": 5, "contact_us_page": 10}	\N	3	1
191	f	2018-10-11 18:52:14.357612+00	{"expired": false, "expire_at": null, "latest_revision_created_at": "2018-10-11T18:50:38.777Z", "date": "2018-09-15", "header_image": 31, "live_revision": 179, "last_published_at": "2018-10-04T18:47:13.409Z", "owner": 1, "content_type": 7, "live": true, "intro": "CAN YOU CONQUER MOTUS? PROVE IT!", "has_unpublished_changes": true, "post_tags": [], "body": "[{\\"id\\": \\"6548ede5-5c3f-48e4-80ce-24ebe3f4abe4\\", \\"value\\": \\"<p>Date: November 17th &amp; 18th</p><p>Adults: 11/17/18</p><p>Kids: 11/18/18</p><p>Competition System: Point</p><p>Max Competitors: 30 (For each age group)</p><p>Fee: Kids / Teens / Adults: $40</p><p>Adult Prizes: 1st - $120, slackline, t-shirt, open gym pass, 2nd - $80, t-shirt, open gym pass, 3rd - $40 &amp; open gym pass</p><p>Kid Prizes: 1st - Slackline, t-shirt, open gym pass, 2nd - T-shirt &amp; open gym pass, 3rd - open gym pass</p><p></p><p>ADULTS</p><p>All competitors will run Stage 1 and Stage 2.</p><p>A combination of Points and Time will determine 1st, 2nd and 3rd place.</p><p>Stage 1 times</p><p>Adults check-in time/warm-up: 8AM-8:15AM</p><p>Adults course rules: 8:20AM</p><p>Adults run start: 8:30AM</p><p>Stage 2 times</p><p>Course rules individually as Stage 1 is completed</p><p>Runs start after rules</p><p>Awards 11:00AM</p><p></p><p>KIDS</p><p>All competitors will run Stage 1 and Stage 2.</p><p>A combination of Points and Time will determine 1st, 2nd and 3rd place.</p><p>Stage 1 Group times</p><p>6-8 years check-in time/warm-up: 9AM-9:15AM</p><p>6-8 years course rules: 9:15AM-9:20AM</p><p>6-8 years run start: 9:20AM</p><p>9-11 years check-in time/warm-up: 12:00PM-12:15PM</p><p>9-11 years course rules: 12:15PM-12:20PM</p><p>9-11 years runs start: 12:20PM</p><p>12-14 years check-in time/warm-up: 3:00PM-3:15PM</p><p>12-14 years course rules: 3:15PM-3:20PM</p><p>12-14 years runs start: 3:20PM</p><p>15-17 years check-in time/warm-up: 6:00PM-6:15PM</p><p>15-17 years course rules: 6:15PM-6:20PM</p><p>15-17 years runs start: 6:20PM</p><p>Stage 2 Group times</p><p>6-8 years Course rules individually as Stage 1 is completed</p><p>6-8 years Runs start after rules</p><p>6-8 years Award 11:30PM</p><p>9-11 years Course rules individually as Stage 1 is completed</p><p>9-11 years Runs start after rules</p><p>9-11 years Award 2:30PM</p><p>12-14 years Course rules individually as Stage 1 is completed</p><p>12-14 years Runs start after rules</p><p>12-14 years Award 5:30PM</p><p>15-17 years Course rules individually as Stage 1 is completed</p><p>15-17 years Runs start after rules</p><p>15-17 years Award 8:30PM</p><p></p><p>Stage 1</p><p>Time limit: 1 minutes 30 sec</p><p>Obstacles: 11</p><p>Points Per Obstacle Completed: 1</p><p>Competitors will receive 1 Point for each obstacle they complete.</p><p>Completing the same obstacle twice will NOT result in more points.</p><p>If an obstacle is failed and there is time remaining on the clock, the competitor may attempt the obstacles again, from the beginning, as many times as needed to obtain a point.</p><p>If a competitor is in the middle of an obstacle and times expires, that obstacle will be considered failed.</p><p>Points will carry-over to Stage 2.</p><p>Stage 2</p><p>Time limit: 3</p><p>Obstacles: 9</p><p>Points Per Obstacle Completed: 1</p><p>Competitors will receive 1 Point for each obstacle they complete.</p><p>Competitors will NOT receive multiple attempts on any obstacle.</p><p>Once an obstacle is failed, they must move on to the next obstacle.</p><p>Competitors may take a 15 second break/rest after completing or failing an obstacle.</p><p></p><p>Email or visit our website to reserve your spot today!</p><p>motusfit1@gmail.com</p><p>https://app.iclasspro.com/parentportal/motus</p>\\", \\"type\\": \\"paragraph_block\\"}]", "seo_title": "", "show_in_menus": false, "first_published_at": "2018-09-17T19:05:58.100Z", "slug": "grand-opening", "search_description": "Motus Ninja Warrior Grand Opening", "title": "Motus Ninja Com