30	f	2018-09-13 18:22:07.632426+00	{"show_in_menus": false, "go_live_at": null, "expire_at": null, "expired": false, "slug": "motus-camp", "header_image": 16, "title": "Motus Camp", "last_published_at": "2018-09-13T13:16:22.836Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"3fa2fc40-ad5d-4c35-b6f2-0d1e6b566671\\", \\"value\\": \\"<p>The Motus Ninja Warrior Camp provides your child with entertaining and challenging activities to keep young minds and bodies sharp. We are dedicated to developing better health through movement and we believe that kids learn best when they are challenged with new and exciting obstacles. This camp will provide the stimulation your child needs to keep growing and developing.</p><p>Our Ninja Warrior Camp is designed to provide your child with entertaining and challenging activities to keep their minds and bodies sharp. Our mission is to develop better health through movement and we believe that young children learn best when they are challenged with new obstacles. Ninja Warrior Camp will provide the stimulation they need to keep them growing and developing into amazing human beings! To enroll your student in our Ninja Warrior Camp, call (816) 347-8008 today!</p>\\"}]", "draft_title": "Motus Camp", "seo_title": "", "search_description": "", "sub_title": null, "depth": 4, "live": true, "path": "0001000200010005", "schedule": "[]", "first_published_at": "2018-09-13T13:16:22.836Z", "intro": "The Motus Ninja Warrior Camp provides your child with entertaining and challenging activities to keep young minds and bodies sharp", "latest_revision_created_at": "2018-09-13T13:16:22.823Z", "has_unpublished_changes": false, "numchild": 0, "url_path": "/index/our-programs/motus-camp/", "pk": 14, "owner": 1, "live_revision": 19, "locked": false, "content_type": 12}	\N	14	1
55	f	2018-09-14 17:57:41.331738+00	{"go_live_at": null, "url_path": "/index/our-programs/motus-camp/", "title": "Motus Camp", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"3fa2fc40-ad5d-4c35-b6f2-0d1e6b566671\\", \\"value\\": \\"<p>Our Ninja Warrior Camp is designed to provide your child with entertaining and challenging activities to keep their minds and bodies sharp. Our mission is to develop better health through movement and we believe that young children learn best when they are challenged with new obstacles. Ninja Warrior Camp will provide the stimulation they need to keep them growing and developing into amazing human beings! To enroll your student in our Ninja Warrior Camp, call (816) 347-8008 today!</p>\\"}]", "last_published_at": "2018-09-13T18:22:07.657Z", "search_description": "", "path": "0001000200010005", "intro": "The Motus Ninja Warrior Camp provides your child with entertaining and challenging activities to keep young minds and bodies sharp.", "latest_revision_created_at": "2018-09-13T18:22:07.632Z", "content_type": 12, "owner": 1, "numchild": 0, "live": true, "seo_title": "", "first_published_at": "2018-09-13T13:16:22.836Z", "expire_at": null, "locked": false, "live_revision": 30, "draft_title": "Motus Camp", "expired": false, "show_in_menus": false, "header_image": 16, "schedule": "[]", "pk": 14, "sub_title": null, "slug": "motus-camp", "has_unpublished_changes": false, "depth": 4}	\N	14	2
52	f	2018-09-14 17:41:32.363466+00	{"go_live_at": null, "url_path": "/index/our-programs/ninja-warriors/", "title": "Ninja Warriors", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"a868084c-9e3f-4516-84c7-20321eb4980a\\", \\"value\\": \\"<p>Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!</p><p></p><ul><li><b>Mini Ninjas(Ages 4-5)</b></li></ul><p>Bring your four and five-year-olds to burn energy while gaining balance and coordination. Our Mini Ninja classes give your kiddos a unique opportunity to take on Ninja Warrior obstacles their size. They will feel like an American Ninja Warrior while racing against time on our speed course. Your little warrior will learn to control their body like a ninja in a safe, fun, and structured environment.</p><p></p><ul><li><b>Ninja Warriors (Ages 6-17)</b></li></ul><p>Our classes are designed to help kids burn energy while gaining balance, strength and coordination. The course offers a unique opportunity to build confidence while overcoming challenges. They will feel like an American Ninja Warrior while racing against time on our speed course. Our ninjas will learn to conquer the course through obstacle progression and skill development. Classes will also focus on increasing strength and agility.  Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</p><p></p><ul><li><b>Adult Ninja Warrior (Ages 18+)</b></li></ul><p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying. \\\\u00a0</p><p>Our Ninja Instructors will guide you through moves for safety, developmental progressions for obstacles, and conditioning to take you to the next level. As you gain better mobility through our program you will enjoy more adventures in life. Whether you want to compete, stay in shape, or just have fun, we are there to make sure you succeed!</p>\\"}]", "last_published_at": "2018-09-14T17:02:33.938Z", "search_description": "", "path": "0001000200010002", "intro": "Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!", "latest_revision_created_at": "2018-09-14T17:02:33.911Z", "content_type": 12, "owner": 1, "numchild": 0, "live": true, "seo_title": "", "first_published_at": "2018-09-13T08:37:20.434Z", "expire_at": null, "locked": false, "live_revision": 48, "draft_title": "Ninja Warriors", "expired": false, "show_in_menus": false, "header_image": 13, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"eccb9fd4-212b-4d46-afd4-92606f6f6a7b\\", \\"value\\": {\\"category\\": \\"Advanced\\", \\"times\\": \\"10:00am;11:00am;2:00pm\\", \\"day\\": \\"TUESDAY\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"746a3c08-9a3e-4ca8-83f9-0498b0399805\\", \\"value\\": {\\"category\\": \\"Beginner 7+\\", \\"times\\": \\"02:00pm;03:00pm;05:00pm\\", \\"day\\": \\"MONDAY\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"7ab79e77-7ead-44dd-a20f-8cf52ed2198c\\", \\"value\\": {\\"category\\": \\"Mini Ninja\\", \\"times\\": \\"9:15am;5:00pm;6:00pm;7:00pm\\", \\"day\\": \\"MONDAY\\"}}]", "pk": 11, "sub_title": "For Kids & Adults", "slug": "ninja-warriors", "has_unpublished_changes": false, "depth": 4}	\N	11	2
