19	f	2018-09-13 13:16:22.8235+00	{"pk": 14, "path": "0001000200010005", "depth": 4, "numchild": 0, "title": "Motus Camp", "draft_title": "Motus Camp", "slug": "motus-camp", "content_type": 12, "live": true, "has_unpublished_changes": false, "url_path": "/index/our-programs/motus-camp/", "owner": 1, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "sub_title": null, "intro": "The Motus Ninja Warrior Camp provides your child with entertaining and challenging activities to keep young minds and bodies sharp", "body": "[{\\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>The Motus Ninja Warrior Camp provides your child with entertaining and challenging activities to keep young minds and bodies sharp. We are dedicated to developing better health through movement and we believe that kids learn best when they are challenged with new and exciting obstacles. This camp will provide the stimulation your child needs to keep growing and developing.</p><p>Our Ninja Warrior Camp is designed to provide your child with entertaining and challenging activities to keep their minds and bodies sharp. Our mission is to develop better health through movement and we believe that young children learn best when they are challenged with new obstacles. Ninja Warrior Camp will provide the stimulation they need to keep them growing and developing into amazing human beings! To enroll your student in our Ninja Warrior Camp, call (816) 347-8008 today!</p>\\", \\"id\\": \\"3fa2fc40-ad5d-4c35-b6f2-0d1e6b566671\\"}]", "schedule": "[]", "header_image": 9}	\N	14	1
16	f	2018-09-13 08:37:20.419261+00	{"pk": 11, "path": "0001000200010002", "depth": 4, "numchild": 0, "title": "Ninja Warriors", "draft_title": "Ninja Warriors", "slug": "ninja-warriors", "content_type": 12, "live": true, "has_unpublished_changes": false, "url_path": "/index/our-programs/ninja-warriors/", "owner": 1, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "sub_title": "For Kids & Adults", "intro": "Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!", "body": "[{\\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!</p><p></p><ul><li><b>Mini Ninjas(Ages 4-5)</b></li></ul><p>Bring your four and five-year-olds to burn energy while gaining balance and coordination. Our Mini Ninja classes give your kiddos a unique opportunity to take on Ninja Warrior obstacles their size. They will feel like an American Ninja Warrior while racing against time on our speed course. Your little warrior will learn to control their body like a ninja in a safe, fun, and structured environment.</p><p></p><ul><li><b>Ninja Warriors (Ages 6-17)</b></li></ul><p>Our classes are designed to challenge each ninjas\\\\u2019 ability. The course offers a unique opportunity to build confidence while overcoming challenges. Your ninja will learn basic moves for safety, developmental progressions for skills, bodyweight exercises and plyo exercises. This will help ninjas increase strength, agility and speed. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</p><p></p><ul><li><b>Adult Ninja Warrior (Ages 18+)</b></li></ul><p>Whether you want to test your skills on obstacles, learn to overcome a challenge for an OCR, or just play on the coolest adult playground, Adult Ninja classes are for you!</p><p>Our instructors teach fundamental techniques to ensure safe and efficient movement that will take you to the next level. You will learn basic moves for safety, developmental progressions for skills, body weight exercises and play exercises.</p><p>This will help you increase strength, agility and speed. Whether you want to compete, stay in shape, or just have fun, we are there to make sure you succeed!</p>\\", \\"id\\": \\"a868084c-9e3f-4516-84c7-20321eb4980a\\"}]", "schedule": "[{\\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"10:00am;11:00am;2:00pm\\", \\"category\\": \\"Advanced\\"}, \\"id\\": \\"eccb9fd4-212b-4d46-afd4-92606f6f6a7b\\"}, {\\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"MONDAY\\", \\"times\\": \\"02:00pm;03:00pm;05:00pm\\", \\"category\\": \\"Beginner 7+\\"}, \\"id\\": \\"746a3c08-9a3e-4ca8-83f9-0498b0399805\\"}, {\\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"MONDAY\\", \\"times\\": \\"9:15am;5:00pm;6:00pm;7:00pm\\", \\"category\\": \\"Mini Ninja\\"}, \\"id\\": \\"7ab79e77-7ead-44dd-a20f-8cf52ed2198c\\"}]", "header_image": 6}	\N	11	1
