139	f	2018-09-17 19:05:58.076575+00	{"expire_at": null, "live": true, "content_type": 7, "date": "2018-09-15", "path": "0001000200030004", "numchild": 0, "seo_title": "", "live_revision": null, "categories": [1], "locked": false, "pk": 20, "slug": "motusfit-grand-opening", "search_description": "", "title": "Grand Opening", "header_image": 24, "depth": 4, "draft_title": "Grand Opening", "go_live_at": null, "owner": 1, "has_unpublished_changes": false, "latest_revision_created_at": null, "expired": false, "body": "[{\\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Enjoy this experience for FREE with your family and friends. Come explore our gym and test your ninja strength.</p><p>\\\\ud83d\\\\udca5Special Offers\\\\ud83d\\\\udca5</p><ul><li>Enroll today and we will waive our $40 Family Fee.</li><li>Enroll today and pay NO tuition for the month of September!</li></ul><p></p><p>Thank you for coming at our Grand Opening! See you soon Ninja fellas</p>\\", \\"id\\": \\"6548ede5-5c3f-48e4-80ce-24ebe3f4abe4\\"}, {\\"type\\": \\"embed_block\\", \\"value\\": \\"https://www.facebook.com/motusninjawarrior/videos/331901390888030/\\", \\"id\\": \\"fd4ed3cc-3b0e-4254-8b11-d52b3edbf82f\\"}]", "url_path": "/index/activities/motusfit-grand-opening/", "intro": "We are excited to have you come experience what Motus has to offer!", "first_published_at": null, "post_tags": [], "last_published_at": null, "show_in_menus": false}	\N	20	1
158	f	2018-09-19 01:57:14.931678+00	{"name": "TJ", "role": "CEO", "live": true, "categories": [1, 2, 3], "depth": 4, "locked": false, "path": "0001000200020003", "pk": 21, "url_path": "/index/motus-crew/tj-el-maestro/", "expire_at": null, "desc": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"be664720-8b50-4891-9580-fec5db21632d\\", \\"value\\": \\"<p>After spending 20+ years in the gymnastics coaching at the highest level, I decided to expand my love on of the sport of gymnastics to Ninja Warrior. Ninja Warrior combines my passion for movement and fitness into one activity. I always have this dream of obstacle courses training to get fit.</p>\\"}]", "latest_revision_created_at": "2018-09-19T01:57:12.473Z", "owner": 1, "intro": "TJ is the founder of xtreme gymnastics and he made the bold decision to launch our new ninja club Motus Ninja Warrior.", "first_published_at": "2018-09-18T15:36:00.113Z", "live_revision": 150, "content_type": 18, "show_in_menus": false, "last_published_at": "2018-09-18T17:03:44.352Z", "seo_title": "", "draft_title": "TJ", "search_description": "", "go_live_at": null, "slug": "tj-el-maestro", "numchild": 0, "title": "TJ", "expired": false, "header_image": 25, "has_unpublished_changes": true}	\N	21	2
242	f	2019-01-25 19:32:47.417789+00	{"go_live_at": null, "expire_at": null, "last_published_at": "2018-09-14T22:44:38.025Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"3fa2fc40-ad5d-4c35-b6f2-0d1e6b566671\\", \\"value\\": \\"<p>Our Ninja Warrior Camp is designed to provide your child with entertaining and challenging activities to keep their minds and bodies sharp. Our mission is to develop better health through movement and we believe that young children learn best when they are challenged with new obstacles. Ninja Warrior Camp will provide the stimulation they need to keep them growing and developing into amazing human beings! To enroll your student in our Ninja Warrior Camp, call (816) 347-8008 today!</p>\\"}]", "show_in_menus": false, "header_image": 16, "slug": "motus-camp", "latest_revision_created_at": "2018-09-15T09:00:49.253Z", "expired": false, "title": "Motus Camp", "content_type": 12, "path": "0001000200010005", "live_revision": 106, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"a42f8d43-be81-4e3e-b3a6-404ebb98c01c\\", \\"value\\": {\\"times\\": \\"10:00-12:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"Motus Camp\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"b7fe0778-23fb-4610-9b2d-5d3977bece1e\\", \\"value\\": {\\"times\\": \\"10:00-12:00\\", \\"day\\": \\"WEDNESDAY\\", \\"category\\": \\"Motus Camp\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"a8599d41-52bb-4e8f-ae6f-36f705ffa953\\", \\"value\\": {\\"times\\": \\"10:00-12:00\\", \\"day\\": \\"TUESDAY\\", \\"category\\": \\"Motus Camp\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"d4a9afa2-120b-4d0e-b9c4-9c2e79e69fdb\\", \\"value\\": {\\"times\\": \\"10:00-12:00\\", \\"day\\": \\"MONDAY\\", \\"category\\": \\"Motus Camp\\"}}]", "locked": false, "live": false, "sub_title": null, "draft_title": "Motus Camp", "url_path": "/index/our-programs/motus-camp/", "seo_title": "", "first_published_at": "2018-09-13T13:16:22.836Z", "has_unpublished_changes": true, "pk": 14, "sear