140	f	2018-09-17 19:06:21.166472+00	{"expire_at": null, "live": true, "content_type": 7, "date": "2018-09-15", "path": "0001000200030004", "numchild": 0, "seo_title": "", "live_revision": 139, "categories": [1], "locked": false, "pk": 20, "slug": "grand-opening", "search_description": "", "title": "Grand Opening", "header_image": 24, "depth": 4, "draft_title": "Grand Opening", "go_live_at": null, "owner": 1, "has_unpublished_changes": false, "latest_revision_created_at": "2018-09-17T19:05:58.076Z", "expired": false, "body": "[{\\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Enjoy this experience for FREE with your family and friends. Come explore our gym and test your ninja strength.</p><p>\\\\ud83d\\\\udca5Special Offers\\\\ud83d\\\\udca5</p><ul><li>Enroll today and we will waive our $40 Family Fee.</li><li>Enroll today and pay NO tuition for the month of September!</li></ul><p></p><p>Thank you for coming at our Grand Opening! See you soon Ninja fellas</p>\\", \\"id\\": \\"6548ede5-5c3f-48e4-80ce-24ebe3f4abe4\\"}, {\\"type\\": \\"embed_block\\", \\"value\\": \\"https://www.facebook.com/motusninjawarrior/videos/331901390888030/\\", \\"id\\": \\"fd4ed3cc-3b0e-4254-8b11-d52b3edbf82f\\"}]", "url_path": "/index/activities/motusfit-grand-opening/", "intro": "We are excited to have you come experience what Motus has to offer!", "first_published_at": "2018-09-17T19:05:58.100Z", "post_tags": [], "last_published_at": "2018-09-17T19:05:58.100Z", "show_in_menus": false}	\N	20	1
196	f	2018-10-11 20:28:37.451889+00	{"expired": false, "expire_at": null, "latest_revision_created_at": "2018-10-11T18:55:01.830Z", "date": "2018-09-15", "header_image": 31, "live_revision": 194, "last_published_at": "2018-10-11T18:55:01.853Z", "owner": 1, "content_type": 7, "live": true, "intro": "CAN YOU CONQUER MOTUS? PROVE IT!", "has_unpublished_changes": false, "post_tags": [], "body": "[{\\"id\\": \\"6548ede5-5c3f-48e4-80ce-24ebe3f4abe4\\", \\"value\\": \\"<p>Date: November 17th &amp; 18th</p><p>Adults: 11/17/18</p><p>Kids: 11/18/18</p><p>Competition System: Point</p><p>Max Competitors: 30 (For each age group)</p><p>Fee: Kids / Teens / Adults: $40</p><p>Adult Prizes: 1st - $120, slackline, t-shirt, open gym pass, 2nd - $80, t-shirt, open gym pass, 3rd - $40 &amp; open gym pass</p><p>Kid Prizes: 1st - Slackline, t-shirt, open gym pass, 2nd - T-shirt &amp; open gym pass, 3rd - open gym pass</p><p></p><p>ADULTS</p><p>All competitors will run Stage 1 and Stage 2.</p><p>A combination of Points and Time will determine 1st, 2nd and 3rd place.</p><p>Stage 1 times</p><p>Adults check-in time/warm-up: 8AM-8:15AM</p><p>Adults course rules: 8:20AM</p><p>Adults run start: 8:30AM</p><p>Stage 2 times</p><p>Course rules individually as Stage 1 is completed</p><p>Runs start after rules</p><p>Awards 11:00AM</p><p></p><p>KIDS</p><p>All competitors will run Stage 1 and Stage 2.</p><p>A combination of Points and Time will determine 1st, 2nd and 3rd place.</p><p>Stage 1 Group times</p><p>6-8 years check-in time/warm-up: 9AM-9:15AM</p><p>6-8 years course rules: 9:15AM-9:20AM</p><p>6-8 years run start: 9:20AM</p><p>9-11 years check-in time/warm-up: 12:00PM-12:15PM</p><p>9-11 years course rules: 12:15PM-12:20PM</p><p>9-11 years runs start: 12:20PM</p><p>12-14 years check-in time/warm-up: 3:00PM-3:15PM</p><p>12-14 years course rules: 3:15PM-3:20PM</p><p>12-14 years runs start: 3:20PM</p><p>15-17 years check-in time/warm-up: 6:00PM-6:15PM</p><p>15-17 years course rules: 6:15PM-6:20PM</p><p>15-17 years runs start: 6:20PM</p><p>Stage 2 Group times</p><p>6-8 years Course rules individually as Stage 1 is completed</p><p>6-8 years Runs start after rules</p><p>6-8 years Award 11:30PM</p><p>9-11 years Course rules individually as Stage 1 is completed</p><p>9-11 years Runs start after rules</p><p>9-11 years Award 2:30PM</p><p>12-14 years Course rules individually as Stage 1 is completed</p><p>12-14 years Runs start after rules</p><p>12-14 years Award 5:30PM</p><p>15-17 years Course rules individually as Stage 1 is completed</p><p>15-17 years Runs start after rules</p><p>15-17 years Award 8:30PM</p><p></p><p>Stage 1</p><p>Time limit: 1 minutes 30 sec</p><p>Obstacles: 11</p><p>Points Per Obstacle Completed: 1</p><p>Competitors will receive 1 Point for each obstacle they complete.</p><p>Completing the same obstacle twice will NOT result in more points.</p><p>If an obstacle is failed and there is time remaining on the clock, the competitor may attempt the obstacles again, from the beginning, as many times as needed to obtain a point.</p><p>If a competitor is in the middle of an obstacle and times expires, that obstacle will be considered failed.</p><p>Points will carry-over to Stage 2.</p><p>Stage 2</p><p>Time limit: 3</p><p>Obstacles: 9</p><p>Points Per Obstacle Completed: 1</p><p>Competitors will receive 1 Point for each obstacle they complete.</p><p>Competitors will NOT receive multiple attempts on any obstacle.</p><p>Once an obstacle is failed, they must move on to the next obstacle.</p><p>Competitors may take a 15 second break/rest after completing or failing an obstacle.</p><p></p><p>Email or visit our website to reserve your spot today!</p><p>motusfit1@gmail.com</p><p><a href=\\\\\\"https://app.iclasspro.com/parentportal/motus\\\\\\">https://app.iclasspro.com/parentportal/motus</a></p>\\", \\"type\\": \\"paragraph_block\\"}]", "seo_title": "", "show_in_menus": false, "first_published_at": "2018-09-17T19:05:58.100Z", "slug": "grand-opening", "search_description": "Motus Ninja Warrior Grand Opening", "title": "Motus Ninja Competition", "numchild": 0, "url_path": "/index/activities/grand-opening/", "pk": 20, "depth": 4, "go_live_at": null, "draft_title": "Motus Ninja Competition", "locked": false, "categories": [1, 2], "path": "0001000200030004"}	\N	20	2
143	f	2018-09-18 15:39:52.123175+00	{"name": "TJ", "role": "Maestro", "live": true, "categories": [1, 2, 3], "depth": 4, "locked": false, "path": "0001000200020003", "pk": 21, "url_path": "/index/motus-crew/tj-el-maestro/", "expire_at": null, "desc": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"be664720-8b50-4891-9580-fec5db21632d\\", \\"value\\": \\"<p>After spending 20+ years in the gymnastics coaching at the highest level, I decided to expand my love on of the sport of gymnastics to Ninja Warrior. Ninja Warrior combines my passion for movement and fitness into one activity. I always have this dream of obstacle courses training to get fit.</p>\\"}]", "latest_revision_created_at": "2018-09-18T15:39:48.721Z", "owner": 1, "intro": "TJ is the founder of xtreme gymnastics and he made the bold decision to launch our new ninja club Motus Ninja Warrior.", "first_published_at": "2018-09-18T15:36:00.113Z", "live_revision": 141, "content_type": 18, "show_in_menus": false, "last_published_at": "2018-09-18T15:36:00.113Z", "seo_title": "", "draft_title": "TJ (il Maestro)", "search_description": "", "go_live_at": null, "slug": "tj-el-maestro", "numchild": 0, "title": "TJ (il Maestro)", "expired": false, "header_image": 25, "has_unpublished_changes": true}	\N	21	1
