27	f	2018-09-13 18:18:13.861211+00	{"show_in_menus": false, "go_live_at": null, "expire_at": null, "expired": false, "slug": "ninja-warriors", "header_image": 13, "title": "Ninja Warriors", "last_published_at": "2018-09-13T08:37:20.434Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"a868084c-9e3f-4516-84c7-20321eb4980a\\", \\"value\\": \\"<p>Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!</p><p></p><ul><li><b>Mini Ninjas(Ages 4-5)</b></li></ul><p>Bring your four and five-year-olds to burn energy while gaining balance and coordination. Our Mini Ninja classes give your kiddos a unique opportunity to take on Ninja Warrior obstacles their size. They will feel like an American Ninja Warrior while racing against time on our speed course. Your little warrior will learn to control their body like a ninja in a safe, fun, and structured environment.</p><p></p><ul><li><b>Ninja Warriors (Ages 6-17)</b></li></ul><p>Our classes are designed to challenge each ninjas\\\\u2019 ability. The course offers a unique opportunity to build confidence while overcoming challenges. Your ninja will learn basic moves for safety, developmental progressions for skills, bodyweight exercises and plyo exercises. This will help ninjas increase strength, agility and speed. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</p><p></p><ul><li><b>Adult Ninja Warrior (Ages 18+)</b></li></ul><p>Whether you want to test your skills on obstacles, learn to overcome a challenge for an OCR, or just play on the coolest adult playground, Adult Ninja classes are for you!</p><p>Our instructors teach fundamental techniques to ensure safe and efficient movement that will take you to the next level. You will learn basic moves for safety, developmental progressions for skills, body weight exercises and play exercises.</p><p>This will help you increase strength, agility and speed. Whether you want to compete, stay in shape, or just have fun, we are there to make sure you succeed!</p>\\"}]", "draft_title": "Ninja Warriors", "seo_title": "", "search_description": "", "sub_title": "For Kids & Adults", "depth": 4, "live": true, "path": "0001000200010002", "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"eccb9fd4-212b-4d46-afd4-92606f6f6a7b\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"10:00am;11:00am;2:00pm\\", \\"category\\": \\"Advanced\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"746a3c08-9a3e-4ca8-83f9-0498b0399805\\", \\"value\\": {\\"day\\": \\"MONDAY\\", \\"times\\": \\"02:00pm;03:00pm;05:00pm\\", \\"category\\": \\"Beginner 7+\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"7ab79e77-7ead-44dd-a20f-8cf52ed2198c\\", \\"value\\": {\\"day\\": \\"MONDAY\\", \\"times\\": \\"9:15am;5:00pm;6:00pm;7:00pm\\", \\"category\\": \\"Mini Ninja\\"}}]", "first_published_at": "2018-09-13T08:37:20.434Z", "intro": "Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!", "latest_revision_created_at": "2018-09-13T08:37:20.419Z", "has_unpublished_changes": false, "numchild": 0, "url_path": "/index/our-programs/ninja-warriors/", "pk": 11, "owner": 1, "live_revision": 16, "locked": false, "content_type": 12}	\N	11	1
