209	f	2019-01-04 22:44:05.529191+00	{"go_live_at": null, "expire_at": null, "subject": "Motus Ninja Warrior - Free Trial Registration", "last_published_at": "2019-01-04T22:42:12.484Z", "from_address": "", "show_in_menus": false, "thank_you_text": "<p>Thank you for choosing Motus as your movement headquarters!</p>", "to_address": "info@motusninjawarrior.com", "form_fields": [], "slug": "free-trial-registration", "latest_revision_created_at": "2019-01-04T22:42:12.458Z", "expired": false, "title": "Free Trial Registration", "content_type": 16, "path": "000100020005", "live_revision": 208, "locked": false, "live": true, "intro": "<p>We are excited to welcome you to Motus Ninja Warrior. Please visit our Parent Portal to sign-up for your FREE trial! <a href=\\"https://app.iclasspro.com/parentportal/motus\\">https://app.iclasspro.com/parentportal/motus</a></p>", "draft_title": "Free Trial Registration", "url_path": "/index/free-trial-registration/", "seo_title": "Motus Ninja Free Trial Registration", "first_published_at": "2018-09-14T20:58:21.743Z", "has_unpublished_changes": false, "pk": 18, "search_description": "", "depth": 3, "numchild": 0, "owner": 1}	\N	18	2
57	f	2018-09-14 18:13:15.661079+00	{"go_live_at": null, "url_path": "/index/motus-crew/donovan-metoyer/", "title": "Donovan Metoyer", "categories": [1, 2], "last_published_at": "2018-09-14T16:48:38.154Z", "search_description": "", "path": "0001000200020002", "intro": "Donovan is a 6 time American Ninja Warrior.", "latest_revision_created_at": "2018-09-14T16:48:38.118Z", "content_type": 18, "owner": 1, "numchild": 0, "live": true, "seo_title": "", "role": "Lead Ninja", "first_published_at": "2018-09-13T13:53:12.007Z", "name": "Donovan", "expire_at": null, "locked": false, "live_revision": 38, "draft_title": "Donovan Metoyer", "expired": false, "show_in_menus": false, "header_image": 11, "desc": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"a9f10318-bbc8-4a51-bfb0-757298fd3643\\", \\"value\\": \\"<p>Metoyer is a 6 time American Ninja Warrior contestant and Season 9 Vegas Finalist! Born and raised in Kansas City, MO, he developed many of his talents here: parkour (before it was a thing), basketball, track and field, computer programming and acting. He\\\\u2019s pretty much a jack-of-all-trades! Armed with an associate\\\\u2019s in computer science and a 2nd Degree Black Belt in Taekwondo, he has a knack for creating course layouts from CAD software and the discipline needed to make sure everything flows, like water.<br/></p>\\"}]", "pk": 17, "slug": "donovan-metoyer", "has_unpublished_changes": false, "depth": 4}	\N	17	2
202	f	2019-01-04 21:59:32.163563+00	{"go_live_at": null, "expire_at": null, "last_published_at": "2018-09-15T08:54:21.004Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"255fe4c9-87bf-4a19-a3b9-025b20284139\\", \\"value\\": \\"<p>Motus offers the most fun in Lee\\\\u2019s Summit with open gyms, parties, field trips, and team building experiences. Unlock your inner warrior on 240&#x27; of obstacle course, one of our 4 warped walls, the campus board, jumping spider, cliffhanger, or maybe even the wing nuts!</p><p></p><p><b>Daily Open Gym</b></p><p>Open gyms are perfect for burning off energy, testing your strength, conquering challenging obstacles, and having fun! You have access to our entire facility and can work at your own pace. This is not an instructor led class but feel free to ask our staff for guidance or to demonstrate an obstacle.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $15 per person</p><p></p><p><b>Friday Night Ninjas</b></p><p>Drop the kids off or stay and watch as they burn off some energy conquering the course. The high-energy obstacles will engage their bodies and minds. The course gives them the opportunity to challenge their friends, learn new skills, and improve their fitness level. Every Friday night we have a speed course challenge. The winner earns a FREE open gym pass!</p><p>Ages 5-14 $15 per person</p><p>7:00pm-9:00pm</p><p>Speed Course Challenge 8:00pm</p><p></p><p><b>Saturday Family Play</b></p><p>Looking for something fun for the family on Saturday nights? Come challenge them on the speed course, try new obstacles, or even learn new skills. Enjoy free reign of all our facility has to offer.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult)</p><p>5:00pm-7:00 pm $10 per person</p><p></p><p><b>Parties</b></p><p>Let us host your event! We offer parties for ages 4 and up for any occasion. The party host and 15 of their friends will discover their inner ninja as they challenge themselves on our many obstacles. Our party staff will take care of everything from set-up to clean-up. Parties include cake, paper goods, drinks, goody bags, and two party coaches! Enjoy an exclusive hour and 15 minutes of play and 30 minutes for cakes and gifts.</p><p>$299+ tax total for 1-15 children, $15 for each additional child. $100 minimum deposit at booking.</p><p>We offer parties every Saturday at 1:00pm and 3:00pm.</p><p></p><p><b>Field Trips/Team Building</b></p><p>Our field trips allow students, staff, team etc. to be active and engaged while using their muscles and brains to complete obstacles for their level. The obstacles and courses offer a unique and safe environment to build confidence and self esteem, while benefiting their health. Be a ninja for a couple hours.</p><p>Our team building will help you grow with your team as you work together to overcome obstacles and learn to conquer challenges. Our crew will bring you a challenge and provide you with tools. Our unique obstacles and environment give your team the opportunity to step out of their comfort zone, think outside the box, and feel the satisfaction of succeeding together.</p><p></p>\\"}]", "show_in_menus": false, "header_image": 12, "slug": "motus-fun", "latest_revision_created_at": "2018-09-15T08:54:20.977Z", "expired": false, "title": "Motus Fun & Parties", "content_type": 12, "path": "0001000200010001", "live_revision": 121, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"6af1d2a1-6f5e-4205-b91c-7fc3a444e9f2\\", \\"value\\": {\\"times\\": \\"9:30-12:00;13:00-17:00\\", \\"day\\": \\"MONDAY\\", \\"category\\": \\"Open Gym\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"6acca39d-aed7-413c-9847-11caf837f5e8\\", \\"value\\": {\\"times\\": \\"9:30-12:00;13:00-19:00\\", \\"day\\": \\"TUESDAY\\", \\"category\\": \\"Open Gym\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"6396629d-7d09-465b-9d6e-5dfee169bcce\\", \\"value\\": {\\"times\\": \\"9:30-12:00;13:00-17:00\\", \\"day\\": \\"WEDNESDAY\\",