47	f	2018-09-14 17:01:32.611164+00	{"go_live_at": null, "url_path": "/index/our-programs/motus-fun/", "title": "Motus Fun", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"255fe4c9-87bf-4a19-a3b9-025b20284139\\", \\"value\\": \\"<p>Motus offers the most fun in Lee\\\\u2019s Summit with open gyms, parties, field trips, and team building experiences. Unlock your inner warrior on 240&#x27; of obstacle course, one of our 4 warped walls, the campus board, jumping spider, cliffhanger, or maybe even the wing nuts!</p><p></p><p><b>Daily Open Gym</b></p><p>Open gyms are perfect for burning off energy, testing your strength, conquering challenging obstacles, and having fun! You have access to our entire facility and can work at your own pace. This is not an instructor led class but feel free to ask our staff for guidance or to demonstrate an obstacle.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $15 per person</p><p></p><p><b>Friday Night Ninjas</b></p><p>Drop the kids off or stay and watch as they burn off some energy conquering the course. The high-energy obstacles will engage their bodies and minds. The course gives them the opportunity to challenge their friends, learn new skills, and improve their fitness level. Every Friday night we have a speed course challenge. The winner earns a FREE open gym pass!</p><p>Ages 5-14 $15 per person </p><p>7:00pm-9:00pm </p><p>Speed Course Challenge 8:00pm</p><p></p><p><b>Saturday Family Play</b></p><p>Looking for something fun for the family on Saturday nights? Come challenge them on the speed course, try new obstacles, or even learn new skills. Enjoy free reign of all our facility has to offer.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult)  </p><p>5:00pm-7:00 pm $10 per person</p><p></p><p><b>Parties</b></p><p>Let us host your event! We offer parties for ages 4 and up for any occasion. The party host and 15 of their friends will discover their inner ninja as they challenge thems