106	f	2018-09-14 22:44:38.000419+00	{"has_unpublished_changes": true, "last_published_at": "2018-09-14T22:24:08.088Z", "body": "[{\\"id\\": \\"3fa2fc40-ad5d-4c35-b6f2-0d1e6b566671\\", \\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Our Ninja Warrior Camp is designed to provide your child with entertaining and challenging activities to keep their minds and bodies sharp. Our mission is to develop better health through movement and we believe that young children learn best when they are challenged with new obstacles. Ninja Warrior Camp will provide the stimulation they need to keep them growing and developing into amazing human beings! To enroll your student in our Ninja Warrior Camp, call (816) 347-8008 today!</p>\\"}]", "numchild": 0, "pk": 14, "live": true, "path": "0001000200010005", "title": "Motus Camp", "expired": false, "content_type": 12, "search_description": "", "schedule": "[{\\"id\\": \\"a42f8d43-be81-4e3e-b3a6-404ebb98c01c\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"THURSDAY\\", \\"times\\": \\"10:00am\\", \\"category\\": \\"-noon Camp\\"}}, {\\"id\\": \\"b7fe0778-23fb-4610-9b2d-5d3977bece1e\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"WEDNESDAY\\", \\"times\\": \\"10:00am\\", \\"category\\": \\"-noon Camp\\"}}, {\\"id\\": \\"a8599d41-52bb-4e8f-ae6f-36f705ffa953\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"10:00am\\", \\"category\\": \\"-noon Camp\\"}}, {\\"id\\": \\"d4a9afa2-120b-4d0e-b9c4-9c2e79e69fdb\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"MONDAY\\", \\"times\\": \\"10am\\", \\"category\\": \\"-noon Camp\\"}}]", "owner": 1, "expire_at": null, "depth": 4, "draft_title": "Motus Camp", "intro": "The Motus Ninja Warrior Camp provides your child with entertaining and challenging activities to keep young minds and bodies sharp.", "first_published_at": "2018-09-13T13:16:22.836Z", "sub_title": null, "show_in_menus": false, "url_path": "/index/our-programs/motus-camp/", "locked": false, "live_revision": 100, "latest_revision_created_at": "2018-09-14T22:44:35.247Z", "slug": "motus-camp", "seo_title": "", "go_live_at": null, "header_image": 16}	\N	14	2
261	f	2019-02-25 18:01:58.668842+00	{"go_live_at": null, "expire_at": null, "last_published_at": "2019-02-25T17:59:29.709Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"a868084c-9e3f-4516-84c7-20321eb4980a\\", \\"value\\": \\"<p>Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!</p><p></p><ul><li><b>Mini Ninjas(Ages 4-5)</b></li></ul><p>Bring your four and five-year-olds to burn energy while gaining balance and coordination. Our Mini Ninja classes give your kiddos a unique opportunity to take on Ninja Warrior obstacles their size. They will feel like an American Ninja Warrior while racing against time on our speed course. Your little warrior will learn to control their body like a ninja in a safe, fun, and structured environment.</p><ul><li><b>Intro to Ninja: Parent and Child (ages 4-15)</b></li></ul><p>Our Intro class allows parents and children to move at their own pace while learning ninja obstacles and techniques. This is an instructor led class, but parents and children will help teach each other by working through the obstacles together with the guidance of the instructor.</p><p></p><p><b>Ninja Warriors (Ages 6-15)</b></p><p>Our classes are designed to help kids burn energy while gaining balance, strength and coordination. The course offers a unique opportunity to build confidence while overcoming challenges. They will feel like an American Ninja Warrior while racing against time on our speed course. Our ninjas will learn to conquer the course through obstacle progression and skill development. Classes will also focus on increasing strength and agility. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</p><p></p><ul><li><b>Adult Ninja Warrior (Ages 16+)</b></li></ul><p>Movement is the foundation of any physically fit lifestyle. Think back to when you were a kid, jumping off benches and climbing trees for fun. Fitness used to be fun and natural, something we achieved without consciously trying.</p><p>Our Ninja Instructors will guide you through moves for safety, developmental progressions for obstacles, and conditioning to take you to the next level. As you gain better mobility through our program you will enjoy more adventures in life. Whether you want to compete, stay in shape, or just have fun, we are there to make sure you succeed!</p>\\"}]", "show_in_menus": false, "header_image": 13, "slug": "ninja-warriors", "latest_revision_created_at": "2019-02-25T17:59:29.678Z", "expired": false, "title": "Ninja Warriors", "content_type": 12, "path": "0001000200010002", "live_revision": 260, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"30b81389-39fb-4689-909f-ef19ff51b546\\", \\"value\\": {\\"times\\": \\"18:00-19:00;19:00-20:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"Adult Ninja Warrior\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"a0a31cc1-a665-4e27-a748-9ec1d27a3761\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"Ninja Warrior (6-15)\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"d1a80711-86fe-4b06-88dd-f7230d72125a\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"Mini Ninja\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"4ec28e1a-56c5-45c5-800c-f035c9493489\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00;19:00-20:00\\", \\"day\\": \\"WEDNESDAY\\", \\"category\\": \\"Ninja Warrior (6-15)\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"5cd6d8d7-686b-4d35-88b1-91ea159a3b0e\\", \\"value\\": {\\"times\\": \\"17:00-18:00;18:00-19:00\\", \\"day\\": \\"WEDNESDAY\\", \\"category\\": \\"Mini Ninja\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"08149a71-437c-47a4-8804-e9ea466b6b0c\\", \\"value\\": {\\"times\\": \\"18:00-19:00;19:00-20:00\\", \\"day\\": \\"TUESDAY\\", \\