48	f	2018-09-14 17:02:33.911978+00	{"go_live_at": null, "url_path": "/index/our-programs/ninja-warriors/", "title": "Ninja Warriors", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"a868084c-9e3f-4516-84c7-20321eb4980a\\", \\"value\\": \\"<p>Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!</p><p></p><ul><li><b>Mini Ninjas(Ages 4-5)</b></li></ul><p>Bring your four and five-year-olds to burn energy while gaining balance and coordination. Our Mini Ninja classes give your kiddos a unique opportunity to take on Ninja Warrior obstacles their size. They will feel like an American Ninja Warrior while racing against time on our speed course. Your little warrior will learn to control their body like a ninja in a safe, fun, and structured environment.</p><p></p><ul><li><b>Ninja Warriors (Ages 6-17)</b></li></ul><p>Our classes are designed to challenge each ninjas\\\\u2019 ability. The course offers a unique opportunity to build confidence while overcoming challenges. Your ninja will learn basic moves for safety, developmental progressions for skills, bodyweight exercises and plyo exercises. This will help ninjas increase strength, agility and speed. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</p><p></p><ul><li><b>Adult Ninja Warrior (Ages 18+)</b></li></ul><p>Whether you want to test your skills on obstacles, learn to overcome a challenge for an OCR, or just play on the coolest adult playground, Adult Ninja classes are for you!</p><p>Our instructors teach fundamental techniques to ensure safe and efficient movement that will take you to the next level. You will learn basic moves for safety, developmental progressions for skills, body weight exercises and plyo exercises.</p><p>This will help you increase strength, agility and speed. Whether you want to compete, stay in shape, or just have fun, we are there to make sure you succeed!</p>\\"}]", "last_published_at": "2018-09-13T18:18:13.900Z", "search_description": "", "path": "0001000200010002", "intro": "Whether you want to test your skills on obstacles, learn to overcome challenges, or just want to try something new, then our Ninja Warrior classes are for you!", "latest_revision_created_at": "2018-09-13T18:18:13.861Z", "content_type": 12, "owner": 1, "numchild": 0, "live": true, "seo_title": "", "first_published_at": "2018-09-13T08:37:20.434Z", "expire_at": null, "locked": false, "live_revision": 27, "draft_title": "Ninja Warriors", "expired": false, "show_in_menus": false, "header_image": 13, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"eccb9fd4-212b-4d46-afd4-92606f6f6a7b\\", \\"value\\": {\\"category\\": \\"Advanced\\", \\"times\\": \\"10:00am;11:00am;2:00pm\\", \\"day\\": \\"TUESDAY\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"746a3c08-9a3e-4ca8-83f9-0498b0399805\\", \\"value\\": {\\"category\\": \\"Beginner 7+\\", \\"times\\": \\"02:00pm;03:00pm;05:00pm\\", \\"day\\": \\"MONDAY\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"7ab79e77-7ead-44dd-a20f-8cf52ed2198c\\", \\"value\\": {\\"category\\": \\"Mini Ninja\\", \\"times\\": \\"9:15am;5:00pm;6:00pm;7:00pm\\", \\"day\\": \\"MONDAY\\"}}]", "pk": 11, "sub_title": "For Kids & Adults", "slug": "ninja-warriors", "has_unpublished_changes": false, "depth": 4}	\N	11	2
243	f	2019-01-25 19:32:52.437382+00	{"go_live_at": null, "expire_at": null, "last_published_at": "2018-09-15T08:56:51.775Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"263bcbb8-cfd7-4536-9aa8-4fa7f8f5c138\\", \\"value\\": \\"<p>Homeschool Motus Kids offers a variety of Ninja Warrior classes for ages 4-17. Our classes will help kids build confidence by overcoming fears and challenges. All while having fun and staying active.</p><p></p><ul><li><b>Homeschool Ninjas</b>: Your child will learn the skills they need to master balance, agility, strength and their overall fitness level - all while having a blast doing it! Every week, our instructors will put together fun new courses to keep things interesting and challenging. Your child will learn basic moves for safety, developmental progressions for skills, conditioning to take them to the next level. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</li></ul>\\"}]", "show_in_menus": false, "header_image": 15, "slug": "homeschool", "latest_revision_created_at": "2018-09-15T08:57:32.345Z", "expired": false, "title": "Homeschool", "content_type": 12, "path": "0001000200010004", "live_revision": 122, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"638aed14-bb15-4e7c-9371-23f975a11d8e\\", \\"value\\": {\\"times\\": \\"14:00-15:00;15:00-16:00\\", \\"day\\": \\"THURSDAY\\", \\"category\\": \\"HS Beginner (7-17)\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"ac5588cd-70ac-4156-93b4-8407ef847bea\\", \\"value\\": {\\"times\\": \\"16:00-17:00\\", \\"day\\": \\"WEDNESDAY\\", \\"category\\": \\"HS Advanced (10-17)\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"ef76a77b-b073-4dd4-bf14-efc7b6b08551\\", \\"value\\": {\\"times\\": \\"14:00-15:00;15:00-16:00\\", \\"day\\": \\"WEDNESDAY\\", \\"category\\": \\"HS Beginner (7-17)\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"dfda7400-fa95-45e0-adca-d3eac21f2a8a\\", \\"value\\": {\\"times\\": \\"