88	f	2018-09-14 22:05:14.298852+00	{"has_unpublished_changes": true, "last_published_at": "2018-09-14T18:01:58.643Z", "body": "[{\\"id\\": \\"263bcbb8-cfd7-4536-9aa8-4fa7f8f5c138\\", \\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Homeschool Motus Kids offers a variety of Ninja Warrior classes for ages 4-17. Our classes will help kids build confidence by overcoming fears and challenges. All while having fun and staying active.</p><p></p><ul><li><b>Homeschool Ninjas</b>: Your child will learn the skills they need to master balance, agility, strength and their overall fitness level - all while having a blast doing it! Every week, our instructors will put together fun new courses to keep things interesting and challenging. Your child will learn basic moves for safety, developmental progressions for skills, conditioning to take them to the next level. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</li></ul>\\"}]", "numchild": 0, "pk": 13, "live": true, "path": "0001000200010004", "title": "Homeschool", "expired": false, "content_type": 12, "search_description": "", "schedule": "[{\\"id\\": \\"638aed14-bb15-4e7c-9371-23f975a11d8e\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"THURSDAY\\", \\"times\\": \\"2:00pm;3:00pm\\", \\"category\\": \\"HS Beginner (7-17)\\"}}, {\\"id\\": \\"ac5588cd-70ac-4156-93b4-8407ef847bea\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"WEDNESDAY\\", \\"times\\": \\"4:00pm\\", \\"category\\": \\"HS Advanced\\"}}, {\\"id\\": \\"ef76a77b-b073-4dd4-bf14-efc7b6b08551\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"WEDNESDAY\\", \\"times\\": \\"2:00pm;3:00pm\\", \\"category\\": \\"HS Beginner (7-17)\\"}}, {\\"id\\": \\"dfda7400-fa95-45e0-adca-d3eac21f2a8a\\", \\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"WEDNESDAY\\", \\"times\\": \\"2:00pm;3:00pm\\", \\"category\\": \\"HS Mini Ninja\\"}}, {\\"id\\": \\"5ed2542c-dc3e-4a3b-a5d