18	f	2018-09-13 13:13:44.985067+00	{"pk": 13, "path": "0001000200010004", "depth": 4, "numchild": 0, "title": "Homeschool", "draft_title": "Homeschool", "slug": "homeschool", "content_type": 12, "live": true, "has_unpublished_changes": false, "url_path": "/index/our-programs/homeschool/", "owner": 1, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "sub_title": "Weekly class", "intro": "Homeschool Motus Kids offers a variety of Ninja Warrior classes for ninjas ages 4-17.  Our obstacle courses will help kids build confidence by overcoming fears and challenges. All while having fun and staying active at Motus.", "body": "[{\\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Homeschool Motus Kids offers a variety of Ninja Warrior classes for ninjas ages 4-17. Our obstacle courses will help kids build confidence by overcoming fears and challenges. All while having fun and staying active.</p><p></p><ul><li><b>Homeschool Ninjas</b>: We have an amazing homeschool program that offers class for ages 4 to 17. Your child will learn the skills they need to master balance, agility, strength and their overall fitness level - all while having a blast doing it! Every week, our instructors will put together fun new courses to keep things interesting and challenging. Your ninja will learn basic moves for safety, developmental progressions for skills, bodyweight exercises and plyo exercises. Whether your child wants to compete, stay in shape for sports, or just have fun, we are there to make sure they succeed!</li></ul>\\", \\"id\\": \\"263bcbb8-cfd7-4536-9aa8-4fa7f8f5c138\\"}]", "schedule": "[{\\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"WEDNESDAY\\", \\"times\\": \\"8:00am;10:00am;12:00pm;3:00pm\\", \\"category\\": \\"Ninja Kids\\"}, \\"id\\": \\"5ed2542c-dc3e-4a3b-a5d7-daf2f76f4291\\"}, {\\"type\\": \\"schedule\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"8:00am;10:00am;12:00pm;3:00pm\\", \\"category\\": \\"Homeschool\\"}, \\"id\\": \\"87fa6214-07f7-4ced-8e6f-2f6440a95d8b\\"}]", "header_image": 8}	\N	13	1
218	f	2019-01-07 18:05:50.458399+00	{"go_live_at": null, "expire_at": null, "last_published_at": "2019-01-07T17:48:52.476Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"255fe4c9-87bf-4a19-a3b9-025b20284139\\", \\"value\\": \\"<p>Motus offers the most fun in Lee\\\\u2019s Summit with open gyms, parties, field trips, and team building experiences. Unlock your inner warrior on 240&#x27; of obstacle course, one of our 4 warped walls, the campus board, jumping spider, cliffhanger, or maybe even the wing nuts!</p><p></p><p><b>Daily Open Gym</b></p><p>Open gyms are perfect for burning off energy, testing your strength, conquering challenging obstacles, and having fun! You have access to our entire facility and can work at your own pace. This is not an instructor led class but feel free to ask our staff for guidance or to demonstrate an obstacle.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $15 per person</p><p></p><p><b>Friday Night Ninjas</b></p><p>Drop the kids off or stay and watch as they burn off some energy conquering the course. The high-energy obstacles will engage their bodies and minds. The course gives them the opportunity to challenge their friends, learn new skills, and improve their fitness level. Every Friday night we have a speed course challenge. The winner earns a FREE open gym pass!</p><p>Ages 5-14 $15 per person</p><p>7:00pm-9:00pm</p><p>Speed Course Challenge 8:00pm</p><p></p><p><b>Saturday Family Play</b></p><p>Looking for something fun for the family on Saturday&#x27;s? Come challenge them on the speed course, try new obstacles, or even learn new skills. Enjoy free reign of all our facility has to offer.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $10 per person</p><p>9:00am-12:00pm</p><p>5:00pm-7:00pm</p><p></p><p><b>Parties</b></p><p>Let us host your event! We offer parties for ages 4 and up for any occasion. The party host and their friends will discover their inner ninja as they challenge themselves on our many obstacles. Our 1:00pm and 3:00pm party&#x27;s are headed by two party coaches, while our 5:00pm parties have no party coach. Our party staff will take care of everything from set-up to clean-up. The 5:00pm parties are set-up by the staff and share the facility with open gym (not exclusive). All parties include cake, paper goods, drinks, and goody bags!! Enjoy an exclusive hour and 15 minutes of play and 30 minutes for cakes and gifts.</p><p>Costs for exclusive parties at 1:00pm and 3:00pm: $299+ tax total for 1-15 children, $10 for each additional child. $100 minimum deposit at booking.</p><p>Costs for non-exclusive parties at 5:00pm: $225+ tax total for 1-15 children, $10 for each additional child. $100 minimum deposit at booking.</p><p></p><p><b>Field Trips/Team Building</b></p><p>Our field trips allow students, staff, team etc. to be active and engaged while using their muscles and brains to complete obstacles for their level. The obstacles and courses offer a unique and safe environment to build confidence and self esteem, while benefiting their health. Be a ninja for a couple hours.</p><p></p><p>Our team building will help you grow with your team as you work together to overcome obstacles and learn to conquer challenges. Our crew will bring you a challenge and provide you with tools. Our unique obstacles and environment give your team the opportunity to step out of their comfort zone, think outside the box, and feel the satisfaction of succeeding together.</p><p></p>\\"}]", "show_in_menus": false, "header_image": 12, "slug": "motus-fun", "latest_revision_created_at": "2019-01-07T17:48:52.452Z", "expired": false, "title": "Motus Fun & Parties", "content_type": 12, "path": "0001000200010001", "live_revision": 217, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"6af1d2a1-6f5e-4205-b91c-7fc3a444e9f2\\", \\"value\\": {\\"times\\": \\"9:30-12:00; 13:00-16:00\\", \\"day\\": \\"MONDAY\\", \\"category\\": \\"Open Gym\\"}}, {\\"type\\