77b-b073-4dd4-bf14-efc7b6b08551\\"}, {\\"value\\": {\\"times\\": \\"14:00-15:00;15:00-16:00\\", \\"day\\": \\"WEDNESDAY\\", \\"category\\": \\"HS Mini Ninja (4-6)\\"}, \\"type\\": \\"schedule\\", \\"id\\": \\"dfda7400-fa95-45e0-adca-d3eac21f2a8a\\"}, {\\"value\\": {\\"times\\": \\"15:00-16:00\\", \\"day\\": \\"TUESDAY\\", \\"category\\": \\"HS Beginner (7-17)\\"}, \\"type\\": \\"schedule\\", \\"id\\": \\"5ed2542c-dc3e-4a3b-a5d7-daf2f76f4291\\"}, {\\"value\\": {\\"times\\": \\"14:00-15:00\\", \\"day\\": \\"TUESDAY\\", \\"category\\": \\"HS Mini Ninja (4-6)\\"}, \\"type\\": \\"schedule\\", \\"id\\": \\"87fa6214-07f7-4ced-8e6f-2f6440a95d8b\\"}, {\\"value\\": {\\"times\\": \\"14:00-15:00;15:00-16:00\\", \\"day\\": \\"MONDAY\\", \\"category\\": \\"HS Beginner (7-17)\\"}, \\"type\\": \\"schedule\\", \\"id\\": \\"c6c873e3-9b56-4028-8c3a-837eec01f9bf\\"}]", "latest_revision_created_at": "2018-09-15T08:56:51.750Z", "first_published_at": "2018-09-13T13:13:45.006Z", "header_image": 15, "slug": "homeschool", "numchild": 0, "expired": false, "search_description": "", "go_live_at": null, "pk": 13, "has_unpublished_changes": false, "live_revision": 122}	\N	13	1
219	f	2019-01-07 18:15:14.287557+00	{"go_live_at": null, "expire_at": null, "last_published_at": "2019-01-07T17:48:52.476Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"255fe4c9-87bf-4a19-a3b9-025b20284139\\", \\"value\\": \\"<p>Motus offers the most fun in Lee\\\\u2019s Summit with open gyms, parties, field trips, and team building experiences. Unlock your inner warrior on 240&#x27; of obstacle course, one of our 4 warped walls, the campus board, jumping spider, cliffhanger, or maybe even the wing nuts!</p><p></p><p><b>Daily Open Gym</b></p><p>Open gyms are perfect for burning off energy, testing your strength, conquering challenging obstacles, and having fun! You have access to our entire facility and can work at your own pace. This is not an instructor led class but feel free to ask our staff for guidance or to demonstrate an obstacle.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $15 per person</p><p></p><p><b>Friday Night Ninjas</b></p><p>Drop the kids off or stay and watch as they burn off some energy conquering the course. The high-energy obstacles will engage their bodies and minds. The course gives them the opportunity to challenge their friends, learn new skills, and improve their fitness level. Every Friday night we have a speed course challenge. The winner earns a FREE open gym pass!</p><p>Ages 5-14 $15 per person</p><p>7:00pm-9:00pm</p><p>Speed Course Challenge 8:00pm</p><p></p><p><b>Saturday Family Play</b></p><p>Looking for something fun for the family on Saturday&#x27;s? Come challenge them on the speed course, try new obstacles, or even learn new skills. Enjoy free reign of all our facility has to offer.</p><p>Ages 4+ (all children under 6 must be accompanied by an adult) $10 per person</p><p>9:00am-12:00pm</p><p>5:00pm-7:00pm</p><p></p><p><b>Parties</b></p><p>Let us host your event! We offer parties for ages 4 and up for any occasion. The party host and their friends will discover their inner ninja as they challenge themselves on our many obstacles. Enjoy an exclusive or non-exclusive hour and 15 minutes of play and 30 minutes for cakes and gifts. </p><p>Our party staff will take care of everything from set-up to clean-up. Our 5:00pm parties only include set-up and share the facility with open gym attendees. All parties include cake, paper goods, drinks, and goody bags!! </p><p>Costs for exclusive parties at 1:00pm and 3:00pm: $299+ tax total for 1-15 children, $10 for each additional child. $100 minimum deposit at booking.</p><p>Costs for non-exclusive parties at 5:00pm: $225+ tax total for 1-15 children, $10 for each additional child. $100 minimum deposit at booking.</p><p></p><p><b>Field Trips/Team Building</b></p><p>Our field trips allow students, staff, team etc. to be active and engaged while using their muscles and brains to complete obstacles for their level. The obstacles and courses offer a unique and safe environment to build confidence and self esteem, while benefiting their health. Be a ninja for a couple hours.</p><p></p><p>Our team building will help you grow with your team as you work together to overcome obstacles and learn to conquer challenges. Our crew will bring you a challenge and provide you with tools. Our unique obstacles and environment give your team the opportunity to step out of their comfort zone, think outside the box, and feel the satisfaction of succeeding together.</p><p></p>\\"}]", "show_in_menus": false, "header_image": 12, "slug": "motus-fun", "latest_revision_created_at": "2019-01-07T18:05:50.458Z", "expired": false, "title": "Motus Fun & Parties", "content_type": 12, "path": "0001000200010001", "live_revision": 217, "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"6af1d2a1-6f5e-4205-b91c-7fc3a444e9f2\\", \\"value\\": {\\"times\\": \\"9:30-12:00; 13:00-16:00\\", \\"day\\": \\"MONDAY\\", \\"category\\": \\"Open Gym\\"}}, {\\"type\\": \\"schedule\\", \\"id\\": \\"6acca39d-aed7-413c-9847-11caf837f5e8\\", \\"value\\": {\\"times\\":