39	f	2018-09-14 16:48:48.295787+00	{"go_live_at": null, "url_path": "/index/motus-crew/trisha-bealmear/", "title": "Trisha Bealmear", "categories": [1, 2, 3], "last_published_at": "2018-09-13T18:24:41.059Z", "search_description": "", "path": "0001000200020001", "intro": "Trisha has been a part of the Motus Crew since 2017. She has a Bachelor's Degree in Business Administration from the University of Central Missouri.", "latest_revision_created_at": "2018-09-13T18:24:41.034Z", "content_type": 18, "owner": 1, "numchild": 0, "live": true, "seo_title": "", "role": "Director of Operations", "first_published_at": "2018-09-13T08:11:10.970Z", "name": "Trisha", "expire_at": null, "locked": false, "live_revision": 34, "draft_title": "Trisha Bealmear", "expired": false, "show_in_menus": false, "header_image": 19, "desc": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"a62efcbc-b401-4345-bb15-5387b4575c95\\", \\"value\\": \\"<p>Trisha has been a part of the Motus Crew since 2017. She has a Bachelor&#x27;s Degree in Business Administration from the University of Central Missouri.</p><p>Trisha Bealmear is a ninja and fitness instructor and helps students aspire to reach their goals and dreams in the gym and outside of the gym. Trisha coached Junior Olympic gymnasts for 6 years and was a competitive athlete in her youth. She has witnessed the benefits of fitness and healthy living in individuals of all backgrounds. Each day, she strives to facilitate those benefits for Motus\\\\u2019 diverse programs by promoting a supportive, inspired environment.</p>\\"}]", "pk": 8, "slug": "trisha-bealmear", "has_unpublished_changes": false, "depth": 4}	\N	8	2
