10	f	2018-09-13 08:13:13.11821+00	{"pk": 9, "path": "0001000200030001", "depth": 4, "numchild": 0, "title": "Ground Zero", "draft_title": "Ground Zero", "slug": "ground-zero", "content_type": 7, "live": true, "has_unpublished_changes": false, "url_path": "/index/our-story/ground-zero/", "owner": 1, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "date": "2018-08-08", "intro": "We wanted to keep it special and true to our values.", "body": "<p>We began running a Gym Warrior program through Xtreme Gymnastics in late 2016. From there we expanded with new obstacles. Our pipe dream was to create a separate business for the Gym Warrior program. Through much brainstorming we decided to create a business plan to see if we could really make our dream come true. After viewing our business plan we decided to go forward with our new company. We searched for a location for months. But then, we were lucky enough to rent space at the current facility, Xtreme Gymnastics and Trampoline.</p>", "header_image": 5, "post_tags": [], "categories": []}	\N	9	1
2	f	2018-09-13 07:48:50.291333+00	{"pk": 4, "path": "0001000100010001", "depth": 4, "numchild": 0, "title": "Our Programs", "draft_title": "Our Programs", "slug": "our-programs", "content_type": 11, "live": true, "has_unpublished_changes": false, "url_path": "/home/motus-web-site/our-programs/", "owner": 1, "seo_title": "", "show_in_menus": false, "search_description": "", "go_live_at": null, "expire_at": null, "expired": false, "locked": false, "first_published_at": null, "last_published_at": null, "latest_revision_created_at": null, "live_revision": null, "intro": "[{\\"type\\": \\"paragraph_block\\", \\"value\\": \\"<p>Our programs are geared towards movement, agility, strength, and attaining full mobility. We strive to help kids and adults lead an active and healthy lifestyle by teaching the importance of exercise in a fun, safe, and supportive environment.</p>\\", \\"id\\": \\"7d4779f6-efd7-41cc-ae39-0b8b3aa65dd1\\"}]"}	\N	4	1
28	f	2018-09-13 18:19:15.396751+00	{"show_in_menus": false, "go_live_at": null, "expire_at": null, "expired": false, "slug": "motus-fit", "header_image": 14, "title": "Motus Fit", "last_published_at": "2018-09-13T08:40:38.305Z", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"37cae8c5-745c-404a-81e3-d2ad1c99dcf7\\", \\"value\\": \\"<p>Do you want to climb Mt. Everest, run a 5K, or just run be able to around? Mouts Fit focuses on increasing movement, balance, and coordination. We strive to get you to your full mobility using your body weight, resistance bands, med balls, jump ropes, and more. Life is about the go and the experiences along the way.</p><p>LIVE MORE!</p><p></p><p><b>Motus Fit</b></p><p>Motus Fit is a high intensity interval workout. Every session combines a variety of movements from many disciplines to create an engaging and challenging workout. Our high-energy instructors ensure guidance, scaling, and customization to accommodate any skill level. The unique environment and equipment make your workout feel more like playing around. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p>Live More!</p><p></p><p><b>Motus Fit Kids (8-17)</b></p><p>Kids just want to have fun and it is possible to show them how to enjoy exercise while improving their health and fitness. Our high-energy instructors will motivate your child through a workout that combines movements from calisthenics, ninja warrior, endurance training, and more. Obstacles will be used to build balance, coordination, confidence, and strength. Row, push-up, jump, sprint, and climb your way to your fitness goals.</p><p>Live More!</p>\\"}]", "draft_title": "Motus Fit", "seo_title": "", "search_description": "", "sub_title": "For Kids & Adults", "depth": 4, "live": true, "path": "0001000200010003", "schedule": "[{\\"type\\": \\"schedule\\", \\"id\\": \\"562993ac-1d6d-4043-91d4-85cf8ebabcf3\\", \\"value\\": {\\"day\\": \\"TUESDAY\\", \\"times\\": \\"9:00am;11:00am;3:00pm\\", \\"category\\": \\"Homeschool\\"}}]", "first_published_at": "2018-09-13T08:40:38.305Z", "intro": "Do you want to climb Mt. Everest, run a 5K, or just be able to run around? Mouts Fit focuses on increasing movement, balance, and coordination.", "latest_revision_created_at": "2018-09-13T08:40:38.283Z", "has_unpublished_changes": false, "numchild": 0, "url_path": "/index/our-programs/motus-fit/", "pk": 12, "owner": 1, "live_revision": 17, "locked": false, "content_type": 12}	\N	12	1
