35	f	2018-09-14 16:43:28.666077+00	{"go_live_at": null, "url_path": "/index/our-story/ground-zero/", "title": "Ground Zero", "body": "[{\\"type\\": \\"paragraph_block\\", \\"id\\": \\"c2ecc7ac-790e-48e5-a842-b92ed630d7b7\\", \\"value\\": \\"<p>Motus Ninja Warrior was founded in 2017 by Tj Rehak, Owner of Xtreme Gymnastics and Trampoline, Trisha Bealmear, Director of Operations for Xtreme and JO Team Coach, Donovan Metoyer, 6 time American Ninja Warrior, and Kyle Ford, former competitive trampolinist and local officer.  We began running a Gym Warrior program through Xtreme Gymnastics in 2016. Our pipe dream was to create a separate business for the Gym Warrior program. Through much brainstorming we decided to create a business plan to see if we could make our dream come true. After reviewing our business plan, we decided to go forward with our new company. We searched for a location for months. But then, we were fortunate enough to rent 7,500 square feet at the current facility, Xtreme Gymnastics and Trampoline.</p>\\"}, {\\"type\\": \\"embed_block\\", \\"id\\": \\"f3a7b2a8-3da7-42ff-9c29-2c2df396f5e3\\", \\"value\\": \\"https://youtu.be/xqT1aQVi6OQ\\"}]", "categories": [], "last_published_at": "2018-09-13T18:23:11.838Z", "search_description": "", "path": "0001000200030001", "intro": "We wanted to create a new program within .", "latest_revision_created_at": "2018-09-13T18:23:11.797Z", "content_type": 7, "owner": 1, "numchild": 0, "live": true, "seo_title": "", "first_published_at": "2018-09-13T08:13:13.135Z", "expire_at": null, "locked": false, "live_revision": 31, "draft_title": "Ground Zero", "expired": false, "show_in_menus": false, "date": "2018-08-08", "header_image": 17, "post_tags": [{"pk": null, "tag": 1, "content_object": 9}], "pk": 9, "slug": "ground-zero", "has_unpublished_changes": false, "depth": 4}	\N	9	2
